    "flavor": "We've had a request come in from the Wycademy asking you to hunt a Great Maccao. The beast has been terrorizing their research team. Take care of it and you'll be able to take on more difficult Quests.",
    "flavor_de": "Die Wykademie hat angefragt, ob du eventuell f\u00fcr sie einen Gro\u00df-Maccao jagen kannst. Die Bestie terrorisiert ihr Forschungsteam. K\u00fcmmer dich darum, dann erh\u00e4ltst du Zugriff auf schwierigere Quests.",
