    "flavor_es": "Los de la Wycademia nos han pedido que caces a un Gran Maccao. Esa bestia tiene aterrorizado a su equipo de investigadores. Oc\u00fapate y podr\u00e1s recibir misiones de mayor rango.",
    "flavor_it": "La Wyccademia ci ha chiesto di cacciare un Gran Maccao. La bestia sta terrorizzando la loro squadra di ricerca. Occupatene e mi assicurer\u00f2 che ti vengano assegnate missioni pi\u00f9 impegnative.",
