    "flavor": "The survey team's been having a lot of trouble -- Rhenoplos keep crashing into everything! All the repairs are takin' a huge chunk out of our budget. Those things have got to go! Can you help us out?",
    "flavor_de": "Wir haben gro\u00dfe Probleme bei der Landvermessung. Rheno- plos rennen st\u00e4ndig alles um! Wir k\u00f6nnen uns die st\u00e4ndigen Reparaturen kaum noch leisten. Das kann so nicht weitergehen. Kannst du da nicht was machen?",
