    "flavor_es": "El equipo de inspecci\u00f3n tiene muchos problemas: \u00a1los Rhenoplos lo destruyen todo! Las reparaciones son car\u00edsimas. Hay que acabar con ellos, \u00bfnos ayudas?",
    "flavor_it": "La squadra rilevamenti \u00e8 in seria difficolt\u00e0 a causa dei Rhenoplos che hanno preso di mira l'attrezzatura! I costi per le riparazioni sono esorbitanti. Dobbiamo fermarli! Puoi aiutarci?",
