    "flavor": "Argh, my wagon just got marooned in the Dunes! Now, I haven't seen anything fishy out here -- yet -- but I just know there's something waiting to get at my stuff! Find it and let 'em have it!",
    "flavor_de": "Oh weh, mein Wagen sitzt fest in den D\u00fcnen! Dort sieht es ruhig aus, aber mit Sicherheit lauert etwas im Verborgenen und will meine Sachen! Sp\u00fcre sie auf und erteile ihnen eine Lektion!",
    "flavor_fr": "Zut, mon chariot est coinc\u00e9 dans les Dunes ! Je n'y ai rien vu de mena\u00e7ant, mais je sais que ma marchandise a attir\u00e9 l'\u0153il d'un monstre ! Trouvez-le et donnez-lui une bonne le\u00e7on !",
    "flavor_es": "Argh, \u00a1mi carro se ha encallado en las Dunas! Todav\u00eda no he visto nada raro por ah\u00ed, pero s\u00e9 que algo va a venir a por mis cosas. \u00a1Encu\u00e9ntralo y que se lo queden!",
    "flavor_it": "Argh, il mio carro \u00e8 stato lasciato sulle dune! Non ho visto nulla di sospetto l\u00ec, non ancora, ma so che c'\u00e8 qualcosa che brama la mia mercanzia! Ti prego, trovalo e fagliela vedere!",
