    "flavor_de": "D... Dank der Genprey in den D\u00fcnen... *aua* und ihrer l\u00e4hm- enden Angriffe kann ich mich \u00fcberhaupt... *autsch* nicht mehr bewegen. Meine Nase juckt so schrecklich... R\u00e4che mich! T\u00f6te 10 von ihnen!",
    "flavor_fr": "\u00c0 cause des Genprey des Dunes et leurs attaques paralysantes, je ne peux m\u00eame plus bouger le petit doigt ! Et j'ai le nez qui me d\u00e9mange ! Vengez-moi en tuant 10 de ces cr\u00e9atures !",
    "flavor_es": "Gracias a... a los Genprey de las Dunas... ay... y a sus ataques paralizantes, no puedo... ay... moverme. \u00a1Y c\u00f3mo me pica la nariz! V\u00e9ngame. \u00a1Mata a 10!",
    "flavor_it": "M-Maledetti Genprey delle dune *ahi* e i loro attacchi paralizzanti! Non riesco a muovere *ahi* un muscolo! Come non bastasse, il naso mi prude da impazzire... Vendicami, uccidine dieci!",
