    "flavor": "When me sandskiff up and died on me, I buried all the edible cargo in the sand to preserve it, but some bloomin' Hermitaurs went and sniffed it out! Can someone hold them off while I work on repairs?",
    "flavor_de": "Als meine Sandjolle den Geist aufgegeben hat, habe ich die ganze essbare Ladung im Sand vergraben. Einige Hermitauren haben sie trotzdem aufgesp\u00fcrt! Kann jemand sie ablenken, so- lange ich die Jolle repariere?",
    "flavor_fr": "Quand mon skiff m'a claqu\u00e9 dans les doigts, j'ai cach\u00e9 mes denr\u00e9es dans le sable. Mais des Hermitaurs les ont flair\u00e9es ! Il faut les retenir pendant que je r\u00e9pare le skiff !",
    "flavor_es": "Cuando mi surcadunas muri\u00f3, enterr\u00e9 toda la mercanc\u00eda comestible para conservarla, \u00a1pero unos Hermitaur la han olfateado! \u00bfAlguien puede entretenerlos mientras hago las reparaciones?",
    "flavor_it": "Quando il mio solcadune mi ha lasciato, ho seppellito le provviste nella sabbia per non farle deperire. Ma quegli Hermitaur stanno rovinando tutto! Chi li terr\u00e0 a bada mentre riparo qui?",
