    "flavor": "Lately there's been a lot of Velociprey creeping up closer and closer to the village. Lots of villagers are worried. Can you calm their fears by doin' in some of those pesky critters?",
    "flavor_de": "In letzter Zeit streifen die Velociprey immer n\u00e4her um unser Dorf herum. Viele Dorfbewohner machen sich Sorgen. Es w\u00fcrde sie bestimmt beruhigen, wenn jemand ein paar t\u00f6ten w\u00fcrde.",
