    "flavor": "Y'know, the more I think about it, the more I wanna move to the Arctic Ridge. But I gotta find a way to stay warm... I bet a coat made from Bulldrome pelts would be roasty-toasty! You game?",
    "flavor_de": "Wei\u00dft du, je mehr ich dr\u00fcber nachdenke, desto mehr will ich ins Schneegebirge ziehen. Ich muss mir nur was \u00fcber- legen, wie ich mich warmhalte. Ein Mantel aus Bulldrome- Pelz h\u00f6rt sich toll an, oder?",
    "flavor_fr": "Plus j'y pense et plus j'ai envie de m'installer sur la Cr\u00eate arctique. Reste le probl\u00e8me du froid, mais je parie qu'un manteau en Bulldrome serait parfait. Je peux compter sur vous ?",
    "flavor_es": "Cuanto m\u00e1s lo pienso, m\u00e1s ganas tengo de ir a vivir a las Cimas \u00c1rticas. Pero con el fr\u00edo que hace ah\u00ed... Apuesto a que un abrigo de piel de Bulldrome me servir\u00eda. \u00bfMe ayudas?",
    "flavor_it": "Pi\u00f9 ci penso e pi\u00f9 mi viene voglia di trasferirmi nella tundra. Ma ho un problema: come posso proteggermi dal freddo? Uhm, scommetto che un bel cappotto di Bulldrome sarebbe perfetto, vero?",
