    "flavor": "You know what Giaprey are, yeah? Those buggers went after my Popo, and after I drove them off, more and more keep showin' up. Time to put 'em on the endangered list, if ya know what I mean.",
    "flavor_de": "Du kennst doch diese Giaprey, oder? Das Viehzeug wollte an meinen Pepe. Je mehr ich verjagt hab, desto mehr sind gekommen! Die sollten schon l\u00e4ngst eine gef\u00e4hrdete Art sein, wenn du verstehst.",
    "flavor_fr": "Ces salet\u00e9s de Giaprey s'en prennent \u00e0 mes Popo, et ils sont toujours plus nombreux. Il est temps de les mettre sur la liste des esp\u00e8ces menac\u00e9es. Vous voyez ce que je veux dire ?",
    "flavor_es": "Sabes qu\u00e9 es un Giaprey, \u00bfno? Los muy malditos fueron tras mi Popo y, aunque los ech\u00e9, cada vez vienen m\u00e1s. Quiero que sean una especie en peligro de extinci\u00f3n, \u00bflo pillas?",
    "flavor_it": "Hai presente i Giaprey? Beh, quei guastafeste hanno preso di mira il mio Popo, e non riesco a farli desistere. \u00c8 il momento di aggiungerli alla lista delle creature estinte! Ci siamo intesi, no?",
