    "flavor": "Oh my gosh! I'm just dying for some Mushroom Juice! All the girls are drinking it, so I gotta get my hands on some, like now! It'd be totally rad if you got me 10 Unique Mushrooms. Pleeeease!",
    "flavor_de": "Oh mein Gott! Ich brauche jetzt unbedingt was von dem Pilzsaft! Alle anderen haben schon davon, ich will auch! Bitte, bitte, bringst du mir 10 Einmalige Pilze? Das w\u00e4re total toll von dir, echt!",
    "flavor_fr": "J'ai trop envie de jus de champi, l\u00e0, tout de suite ! Les autres filles ne jurent que par \u00e7a. Ce serait trop chouette si vous pouviez me trouver 10 champignons sp\u00e9ciaux. C'est d'accord ?",
    "flavor_es": "\u00a1Dios m\u00edo! \u00a1Me muero por un zumo de setas! Todas las chicas lo toman, tengo que conseguir uno como sea, y \u00a1cuanto antes! Ser\u00eda genial que me consiguieses 10 setas especiales. Porfi...",
    "flavor_it": "Santo cielo! Cosa non darei per una spremuta di funghi! Tutte le ragazze ne vanno matte, devo assolutamente provarla anch'io! Oh, se solo potessi procurarmi dieci funghi speciali!",
