    "flavor_de": "Der Gro\u00df-Maccao ist wahrhaft ein Wunder der Natur. Vor allem sein Schwanz. Ich wollte ihn nur mal genauer ansehen und bin ihm dabei zu nahe gekommen. Jetzt sind zwei von denen hinter mir her...",
