    "flavor_es": "\u00bfSab\u00edas que la ropa de Bnahabra es lo m\u00e1s? \u00a1Dinero f\u00e1cil! Pero no consigo que se queden quietos para coserlos. \u00bfPuedes conseguir que dejen de retorcerse?",
    "flavor_it": "Sapevi che gli abiti di Bnahabra sono la moda del momento? Purtroppo, non riesco a tenerli fermi mentre li cucio! Potresti farli smettere di dimenarsi una volta per tutte?",
