    "flavor": "A buddy of mine went off to the Dunes in search of materials and got pounced on by a Daimew, er, I mean Daimyo Hermitaur! Now we're in a pinch to get him back! Can you crush that crustacean for us?",
    "flavor_de": "Ein Kumpel von mir ist in die D\u00fcnen gegangen, Material suchen, und wurde von einem Daimiau, \u00e4h, ich meine Daimyo Hermitaur angegriffen! Wir m\u00fcssen ihn da rausholen, kannst du die Sache f\u00fcr uns knacken?",
    "flavor_fr": "L'un des n\u00f4tres cherchait des mat\u00e9riaux dans les Dunes quand un Hermitaur Daimyo lui est tomb\u00e9 dessus. Nous avons besoin d'aide pour le tirer de l\u00e0. \u00c9crasez ce crustac\u00e9 !",
    "flavor_es": "Un compa\u00f1ero m\u00edo fue a las Dunas a buscar cosas y le atac\u00f3 un Daimiau, digo Daimyo Hermitaur. Ahora tenemos que rescatarlo. \u00bfPuedes destruir a ese crust\u00e1ceo por nosotros?",
    "flavor_it": "Un amico si \u00e8 avventurato nel deserto in cerca di materiali ed \u00e8 stato assalito da un Daimiao... ehm... Daimyo Hermitaur! Dobbiamo aiutarlo! Potresti scrostare quel crostaceo?",
