    "flavor": "One minute I was rattlin' along the Dunes in me barrel buggy, mindin' me own. And then, RAAARRR! Cart goes flyin' -- and me with it! What gives!? The barrel business is s'pposed t'be safe, by gum!",
    "flavor_de": "Ich war mit meinem Fass- Buggy in den D\u00fcnen und dachte an nichts B\u00f6ses. Und dann: RAAARRR! In hohem Bogen heben wir ab: Bruch- landung! Dabei soll Fass- handel doch so sicher sein!",
    "flavor_fr": "Je traversais les Dunes sur mon chariot \u00e0 tonneaux sans d\u00e9ranger personne et VLAN ! Le chariot s'est mis \u00e0 voler dans les airs ! Moi qui croyais que le commerce de tonneaux \u00e9tait tranquille...",
    "flavor_es": "Un minuto iba tan tranquilo por las Dunas en mi carro, sin meterme con nadie, y de repente... \u00a1BAM! El carro sale volando y yo dentro. Y eso que se supone que era un negocio seguro.",
    "flavor_it": "Ero l\u00ec a sferragliare tra le dune con la mia bottemobile quando ROAR!, un mostro mi scaglia in aria con baracca e burattini! Ma che diavolo? Quello del bottaio dovrebbe essere un lavoro tranquillo!",
