    "flavor_fr": "Le Konchu est une cr\u00e9ature fascinante ! Si vous l'attaquez, il passera en mode d\u00e9fensif pour tenter une esquive. J'ai besoin de nouveaux sp\u00e9cimens pour mes recherches !",
    "flavor_es": "El Konchu es una criatura fascinante... \u00a1Un bicho con varias metamorfosis! At\u00e1calo y ver\u00e1s c\u00f3mo cambia a una forma defensiva para protegerse. \u00a1Necesito m\u00e1s ejemplares para investigar!",
