    "flavor_de": "Grrr! Irgendwann reicht's aber! Hermitauren, die sich in den D\u00fcnen aufspielen, nur weil sie mehr sind als wir! Eine schnurrig gro\u00dfe Bitte, lieber J\u00e4ger, hilf uns da weiter!",
    "flavor_fr": "Grrr ! \u00c7a commence \u00e0 bien faire ! Ces Hermitaur croient que les Dunes sont \u00e0 eux sous pr\u00e9texte qu'ils sont plus nombreux. D\u00e9barrassez-nous de cette gangr\u00e8ne, s'il vous pla\u00eet.",
    "flavor_es": "\u00a1Grrr! \u00a1Ya basta! Esos Hermitaur se comportan como los amomiaus de las Dunas. \u00a1Y son un mont\u00f3n! Por favor, cazador, libra las Dunas de esta cruz.",
    "flavor_it": "Grrr! Ho un diavolo per baffo! Quegli Hermitaur si comportano come se fossero i padrrroni delle dune. E sono molti pi\u00f9 di noi! Ti prrrego, libera le dune da questa piaga!",
