    "flavor": "Mushrooms from the Verdant Hills are suddenly in high demand. If you gather me ten, I'll give you a cut of the profits. Oh, I heard that Velocidrome hang around there, so stay sharp!",
    "flavor_de": "Pilze aus den Gr\u00fcnen H\u00fcgeln sind aktuell sehr begehrt. Wenn du mir 10 bringst, beteilige ich dich gerne am Gewinn. Ach ja, ich h\u00f6rte von dem Velocidrome in der Gegend. Bleib wachsam!",
    "flavor_fr": "Les champignons des Collines verdoyantes sont tr\u00e8s pris\u00e9s en ce moment. Si vous m'en rapportez 10, on partagera les b\u00e9n\u00e9fices. Et m\u00e9fiez-vous des Velocidrome, compris ?",
    "flavor_es": "Hay mucha demanda de setas del Bosque Rocoso. Si me consigues 10, te dar\u00e9 parte de los beneficios. \u00a1Ah, y he o\u00eddo que hay Velocidrome por ah\u00ed, as\u00ed que atento!",
    "flavor_it": "Ultimamente c'\u00e8 una forte richiesta di funghi dai colli verdi. Portamene dieci e ti elargir\u00f2 parte dei profitti. Oh, ho sentito che ci sono dei Velocidrome in quella zona, quindi occhio!",
