    "flavor": "Yian Kut-Ku have been going after people all over the place, and during my patrol earlier, I spotted one wandering close to town. That curious bugger must be after some Konchu. Can you get rid of it?",
    "flavor_de": "\u00dcberall greifen Yian Kut-Ku die Menschen an. Bei meinem Rundgang ist mir in der N\u00e4he der Stadt einer von ihnen aufgefallen. Bestimmt hat er es auf die Konchu abgesehen. Kannst du ihn vertreiben?",
