    "flavor": "I've gotten my paws on all kinds of monster meat before. You name it, I've grilled it. But I've never tried my paw at grilling up some Anteka. Help me out and we'll have a barbeque for the ages!",
    "flavor_de": "Ich hab schon alle Arten Monsterfleisch in den Pfoten gehabt. Es gibt nichts, was ich noch nicht gegrillt h\u00e4tte! Au\u00dfer Anteka. Hilf mir, etwas Fleisch zu besorgen, und wir machen das Grillfest des Jahres!",
    "flavor_fr": "J'ai vu passer toutes sortes de viande de monstre par le pass\u00e9, mais je n'ai encore jamais tent\u00e9 de pr\u00e9parer des grillades d'Anteka. Aidez-moi et on organisera un barbecue m\u00e9morable.",
    "flavor_es": "He puesto las patitas en todo tipo de carne de monstruo, pero nunca he cocinado Anteka. Ay\u00fadame y disfrutaremos de una barbacoa \u00e9pica.",
    "flavor_it": "Ho messo le zampe su ogni sorta di carne di mostro. Non c'\u00e8 bestia che non abbia grigliato. Tranne l'Anteka! Aiutami a colmare la lacuna e prrreparer\u00f2 la grigliata del secolo!",
