    "flavor_fr": "Nous menions des recherches sur la Cr\u00eate arctique quand une cr\u00e9ature r\u00e9pugnante a surgi derri\u00e8re nous. Impossible de retourner l\u00e0-haut tant qu'elle s'y trouve !",
    "flavor_es": "Est\u00e1bamos investigando en las Cimas \u00c1rticas cuando de repente apareci\u00f3 algo muy asqueroso. Logramos huir, pero no podemos investigar mientras esa cosa siga ah\u00ed.",
