    "flavor": "Ugh! My backside's seen better days. Blame the Bullfango! My mom sent me to the Misty Peaks to dig up mushrooms, see, and all of a sudden those beasts were behind me! Long story short, my bottom needs avenging!",
    "flavor_de": "Oh, meiner R\u00fcckseite ging es schon mal besser. Bl\u00f6der Bullfango! Ich sollte f\u00fcr mei- ne Mutter Pilze in den Nebel- gipfeln sammeln, als sich die Bestien auf mich st\u00fcrzten! Mein Hintern will Rache!",
    "flavor_fr": "A\u00efe ! Mon popotin me fait souffrir. C'est \u00e0 cause des Bullfango ! J'\u00e9tais \u00e0 la cueillette aux champignons dans les Pics brumeux, quand ces b\u00eates me sont tomb\u00e9es dessus ! En bref, vengez mon derri\u00e8re !",
    "flavor_es": "\u00a1Ag! Mi trasero ha vivido d\u00edas mejores. \u00a1Y todo por los Bullfango! Mi madre me envi\u00f3 a los Picos Nublados a por setas, \u00a1y de repente me vi cercado por esas bestias! \u00a1Mi trasero clama venganza!",
    "flavor_it": "Il mio didietro ha vissuto giorni migliori. Tutta colpa dei Bullfango! Raccoglievo funghi, quando queste belve mi hanno attaccato alle spalle, all'improvviso! Il mio sedere grida vendetta!",
    "flavor_ja": "",
    "sub_reward": "1200",
    "sub_hrp": "80"
