    "flavor_de": "Verdammte Rathian! Lauerte tats\u00e4chlich meiner Karawane auf und vermasselt mir das Gesch\u00e4ft! Aber da hat sie sich verrechnet! Ich will Rache und du sollst sie in meinem Namen ausf\u00fchren!",
