    "flavor_de": "Argh, geben diese Yian Kut-Ku denn nie Ruhe? Sie rennen und schreien st\u00e4ndig, das scheint schon fast wie Absicht! Mir egal, wie, aber bitte jage so viele von ihnen wie n\u00f6tig, damit hier Ruhe herrscht.",
    "flavor_fr": "Grrr, ces Yian Kut-Ku vont-ils enfin la boucler ? J'ai l'impression qu'ils font expr\u00e8s de courir en hurlant. D\u00e9brouillez-vous, mais tuez-en assez pour ramener le calme !",
    "flavor_es": "Argh, \u00bfcu\u00e1ndo se callar\u00e1n esos Yian Kut-Ku? Corren y gritan tanto que casi es como si lo hicieran adrede. No me importa c\u00f3mo, pero caza todos los que puedas y restaura la paz.",
    "flavor_it": "Argh! Perch\u00e9 gli Yian Kut-Ku non stanno mai zitti? Urlano al punto che inizio a credere che lo facciano di proposito per darmi fastidio! Cacciane pi\u00f9 che puoi e riporta la pace.",
