    "flavor": "Nyaaargh! My pointy little ears hurt from the yowling of those Velocidrome! I pounced on one, but more just followed! I dunno how many there are, but save me from their apawling screeches!",
    "flavor_de": "Mirrrr-jau! Meine spitzen \u00d6hrchen schmerzen von Velo- cidrome-Gekreisch. Ich hab einen erwischt, keine Ahnung, wie viele da noch sind. Bitte rette meine armen \u00d6hrchen vor dem entk\u00e4tzlichen L\u00e4rm!",
    "flavor_fr": "Aah ! Mes d\u00e9licates oreilles pointues souffrent des hurlements des Velocidrome. j'ai bien tent\u00e9 d'en taper un, mais \u00e7a n'a fait qu'en attirer d'autres. Piti\u00e9, sauvez-moi de ce vacarme !",
    "flavor_es": "\u00a1Argh! Me duelen las orejas puntiagudas de tanto o\u00edr miaullidos de Velocidrome. Golpe\u00e9 a uno, pero vinieron m\u00e1s. No s\u00e9 cu\u00e1ntos hay, pero s\u00e1lvame de sus miaullidos horribles.",
    "flavor_it": "Miaaao! Gli ululati dei Velocidrome stanno uccidendo le mie povere orecchie a punta! Ne ho aggredito uno, ma ne sono sbucati altri! Occupatene prrrsonalmente e salvami da questo strazio!",
