    "flavor": "I'm reporting live from the Arctic Ridge where two Lagombi are making their way across the frozen landscape. I could stand here and watch these graceful creatures all day! ...Wait, are they coming this way!? RUN!",
    "flavor_de": "Ich berichte live aus dem Schneegebirge, wo sich zwei Lagombi ihren Weg durch die Eislandschaft mit der Eleganz von Eisballerinen bahnen. Ich k\u00f6nnte ihnen ewig zusehen. Oh, kommen sie her? WEG!",
    "flavor_fr": "Je suis en direct de la toundra, o\u00f9 deux Lagombi traversent le paysage gel\u00e9 comme des ballerines. Je passerais la journ\u00e9e \u00e0 les regarder. Attention, ils arrivent ! FUYEZ !",
    "flavor_es": "Me encuentro en las Cimas \u00c1rticas, donde dos Lagombi se abren paso a trav\u00e9s del g\u00e9lido paisaje, elegantes como bailarines sobre hielo. \u00a1Me pasar\u00eda el d\u00eda vi\u00e9ndolos! ... Esperad, \u00bfvienen? \u00a1Corred!",
    "flavor_it": "In diretta dal monte artico, due Lagombi avanzano con la grazia di pattinatrici sul ghiaccio. Potrei restare a guardare lo spettacolo per tutto il giorno! Ma... cosa? Vengono verso di me?!",
