    "flavor": "Night fishing is pure bliss, I tell ya. It's cool...quiet. You can see the stars reflected in the water. Last night, I saw two red shooting stars streak overhead. Next thing I know, I'm bruised and battered.",
    "flavor_de": "Nachtfischen ist das reinste Vergn\u00fcgen. Diese Ruhe. Die Sterne spiegeln sich im Wasser. Beim letzten Mal sah ich zwei rote Sternschnuppen. Dann wei\u00df ich nur noch, dass ich verletzt am Boden lag...",
    "flavor_fr": "J'adore p\u00eacher la nuit. Il fait frais, tout est calme. Les \u00e9toiles se refl\u00e8tent dans l'eau. La derni\u00e8re fois, j'ai vu deux \u00e9toiles rouges, et je me suis retrouv\u00e9 couvert de bleus.",
    "flavor_es": "Pescar de noche es una delicia, de verdad. Relajado. Tranquilo. Ves el reflejo de las estrellas en el agua. Hace poco vi pasar dos estrellas fugaces rojas. Acab\u00e9 herido. \u00bfUna delicia?",
    "flavor_it": "Pescare di notte \u00e8 bello! L'aria \u00e8 fresca. Le stelle luccicano sull'acqua... Ma ieri due stelle cadenti rosse sono passate sopra la mia testa. Poi... quando ho ripreso i sensi, ero a pezzi!",
