    "flavor_de": "Oh mein Grundg\u00fctiger! Wei\u00dfkragen, gesegnet sei er, hat sich aufgemacht, die Daimyo Hermitauren zu ver- treiben. Ich mache mir echt Sorgen um ihn. Sei doch bitte so gut und hilf ihm dabei, ja?",
