    "flavor_es": "\u00a1Madre m\u00eda! El Gallinita blanco, bendito sea, ha salido a echar a unos Daimyo Hermitaur que han aparecido \u00faltimamente. Me tiene preocupado. Ve a ayudarle, por favor.",
    "flavor_it": "Oh, santi sughi! Palla di Neve s'\u00e8 messo in testa di cacciare quei Daimyo Hermitaur apparsi di recente. Sono preoccupato! Ti prego, aiutalo prima che sia troppo tardi.",
    "flavor_ja": "",
