    "flavor_es": "Un aut\u00e9ntico horror acecha entre la bruma de la Ci\u00e9naga. Dos wyverns voladores, piel p\u00e1lida reluciente, cuerpos chispeantes por la electricidad. \u00a1Cuidado! \u00a1Los tienes justo detr\u00e1s!",
