    "flavor_de": "Der Uruktor ist schon eine faszinierende Kreatur! Er gr\u00e4bt sich direkt ins Vulkan- gestein. Wie ist so was \u00fcber- haupt m\u00f6glich? Ich w\u00fcrde das gerne erforschen, aber ich brauche Hilfe dabei!",
