    "flavor_es": "Los Uroktor son criaturas fascinantes. Agujerean la roca volc\u00e1nica, \u00bfc\u00f3mo es posible? Quiero saber m\u00e1s de ellos, pero no dejan de dispararme bolas de fuego. \u00a1Ay\u00fadame a conocerlos m\u00e1s!",
