    "flavor_de": "In den D\u00fcnen wurde eine Gruppe von drei Nibelsnarf gesichtet. Das kann ganz sch\u00f6n \u00c4rger bedeuten. Aber sicher ist, dass sich irgendjemand um diese drei \u00fcbergro\u00dfen Kaulquappen k\u00fcmmern muss.",
