    "flavor_fr": "Un mauvais pr\u00e9sage annonce une catastrophe dans la r\u00e9gion du Volcan. Il nous faut agir. Allez tuer 10 serpents pour juguler la menace avant qu'il ne soit trop tard !",
    "flavor_es": "Percibo un mal augurio que podr\u00eda ser desastroso para el Volc\u00e1n si nadie lo va a comprobar. Mata a 10 serpientes para atajar el peligro a tiempo.",
