    "flavor": "I train the only way a warrior can -- with full abandon! Yet whenever I perform my kata, monsters gather around me. Honorable hunter! Winnow the beasts from this place so that I may hone my body properly!",
    "flavor_de": "Ich trainiere so, wie ein wahrer Krieger k\u00e4mpft \u2013 mit voller Hingabe. Aber wenn ich meine Kata laufe, kommen von \u00fcber- all Monster an! Werter J\u00e4ger, sei so gut und s\u00e4ubere diesen Ort, damit ich trainieren kann!",
    "flavor_fr": "Je m'entra\u00eene sans rel\u00e2che, comme tous les vrais guerriers, mais mon kata attire les monstres. Chassez-les d'ici afin que mon corps puisse devenir l'arme qu'il doit \u00eatre.",
    "flavor_es": "Entreno como tiene que entrenar un guerrero: \u00a1al m\u00e1ximo! Hago mi kata y los monstruos me rodean. Honorable cazador, disp\u00e9rsalos para que pueda entrenar como es debido.",
    "flavor_it": "Un vero guerriero deve addestrarsi con assoluta dedizione! Purtroppo, ogni volta quei malefici mostri mi circondano. Scuoia quelle bestiacce, cos\u00ec che possa allenarmi in santa pace!",
