    "flavor": "My ship was cruising over the sand when we suddenly ran aground, our cargo spilling hither and yon. Now, the local monsters are really keen on taking it, so I need you to dissuade them!",
    "flavor_de": "Mein Schiff flog geradezu \u00fcber den Sand, als wir pl\u00f6tzlich auf Grund liefen. Unsere ganze Ladung ist jetzt verstreut und zieht Monster an! Kannst du die Viecher von der Fracht abhalten?",
    "flavor_fr": "Mon navire survolait le d\u00e9sert quand il s'est \u00e9chou\u00e9, r\u00e9pandant du m\u00eame coup toute sa cargaison. Le hic, c'est que des monstres veulent s'en emparer. Vous devez les en dissuader.",
    "flavor_es": "Navegaba por las Dunas y de repente embarrancamos. Nuestra carga se desparram\u00f3 y los monstruos la quieren, as\u00ed que necesito que los disuadas.",
