    "flavor": "This island is, like, sooo amazing, don'tcha think? It's got unique evolutionary patterns you can't find aaanywhere else! Sweet, huh? So, like, be a pal and hunt me a monster! For science!",
    "flavor_de": "Diese Insel ist echt sooooo faszinierend, oder? Oder? Die Muster der Evolution hier sind absolut fas-zi-nierend! Echt unglaublich! Also, mein Freund, sei so nett und jag mir ein Monster. F\u00fcr die Wissenschaft!",
    "flavor_fr": "Cette \u00eele est stup\u00e9fiante, pas vrai ? L'\u00e9volution y a suivi des voies tout \u00e0 fait uniques. G\u00e9nial, hein ? Alors, soyez sympa et allez chasser un monstre pour moi... et pour la science !",
    "flavor_es": "Esta isla es s\u00faper guay, \u00bfno crees? Tiene patrones evolutivos \u00fanicos que no est\u00e1n en ning\u00fan otro sitio. \u00a1Grande! Anda, s\u00e9 legal, tr\u00e1eme un monstruo.",
    "flavor_it": "Quest'isola \u00e8 sorprendente, non credi? Qui \u00e8 possibile osservare modelli evolutivi non presenti da nessun'altra parte! Bello, eh? Ora fammi felice e caccia un mostro. Per la scienza!",
