    "flavor_de": "Der teuflische Glavenus ist wieder zur\u00fcck im Jura-Grenzland. Wir haben hohe Verluste unter den Wykademie-Forschern zu beklagen. Keine Zeit f\u00fcr mehr Erkl\u00e4rungen, jemand muss was tun. Ich z\u00e4hle auf dich.",
    "flavor_fr": "Ce satan\u00e9 Glavenus refait des siennes sur la Fronti\u00e8re jurassique et les chercheurs de la Wycad\u00e9mie ont subi de lourdes pertes. Assez tergivers\u00e9, cette b\u00eate doit dispara\u00eetre. Et vite !",
