    "flavor": "Beneath the azure skies of the Jurassic Frontier lurks a mysterious monster cloaked in black. Writhing in pain, it glares from unseen eyes. The hunter or the hunted: Which will you be?",
    "flavor_de": "Unter dem blauen Himmel des Jura-Grenzlands lauert ein geheimnisvolles Monster, von Schw\u00e4rze umgeben. Seine Augen unsichtbar, seine Qualen sp\u00fcrbar. J\u00e4ger oder Gejagter: Was bist du?",
