    "flavor_de": "Ich habe mir im Jura-Grenz- land die Pfoten abtrainiert, als ich, \u00e4hm, naja, einem Zinogre auf den Schwanz getreten bin, sozusagen. Echt bl\u00f6d von mir! Und allein werd ich mit dem nicht fertig!",
