    "flavor": "Ever taken a jump kick from a Great Maccao? I have! It nailed me, but I got up and wrecked it hard! You jelly? If you think you can do the same, then let me see what you got!",
    "flavor_de": "Schon mal einen Sprungtritt von einem Gro\u00df-Maccao abbekommen? Hat mich glatt umgehauen, aber ich hab's ihm heimgezahlt! Wenn du's mir nachtun m\u00f6chtest, lass sehen, was du kannst, okay?",
    "flavor_fr": "Vous avez d\u00e9j\u00e0 encaiss\u00e9 un coup de pied saut\u00e9 d'un Grand Maccao ? Moi, oui ! Je l'ai senti passer, mais je me suis relev\u00e9 pour le d\u00e9rouiller. Vous pouvez en faire autant ?",
    "flavor_es": "\u00bfAlguna vez has recibido una patada de un Gran Maccao? \u00a1Yo s\u00ed! Y me levant\u00e9 y le di una buena. Si crees que podr\u00edas hacer lo mismo, demu\u00e9stralo.",
