    "flavor": "My luck is so bad lately. First a Gypceros swipes my Book of Combos, and then a Melynx runs off with my BBQ Spit! At this rate, I'm gonna have to quit hunting! Can you help me out here!?",
    "flavor_de": "Ich habe solch ein Pech in letzter Zeit. Erst stiehlt ein Gypceros mein Kombi- Buch und dann stibitzt eine Melynx meinen Grillspie\u00df. Wenn's so weitergeht, war's das f\u00fcr mich. Bitte hilf mir!",
