    "flavor_es": "Estaba dando un paseo y una manada de Maccao me rode\u00f3. Esos rostros rojos... \u00a1Me pas\u00e9 d\u00edas catat\u00f3nico! Ahora tengo miauedo y no salgo. \u00bfMe ayudas, cazador?",
