    "flavor_de": "Ich frage nicht gern einen J\u00e4ger um Hilfe, aber ein riesiger Hermitaur ist in den D\u00fcnen und l\u00e4sst sich nicht vertreiben. Ich bin machtlos gegen ihn. Du musst dich um ihn k\u00fcmmern.",
    "flavor_fr": "Je d\u00e9teste demander de l'aide aux chasseurs, mais je n'arrive pas \u00e0 vaincre l'Hermitaur des Dunes. J'ai beau frapper, rien n'y fait. Il faudrait que vous vous en chargiez.",
    "flavor_es": "No me gusta pedir ayuda a los cazadores, pero hay un Hermitaur enorme en las Dunas y no puedo con \u00e9l. No consigo herirlo. Necesito que vayas t\u00fa en mi lugar.",
    "flavor_it": "Detesto chiedere aiuto ai cacciatori, ma c'\u00e8 un enorme Hermitaur sulle dune che proprio non vuole andare gi\u00f9. Ho provato di tutto, ma non riesco a ferirlo. Mi serve che tu lo sconfigga.",
    "flavor_ja": "",
    "sub_reward": "600",
    "sub_hrp": "30"
