    "flavor_fr": "Les Hermitaur enfouis dans le sable menacent de plus en plus nos activit\u00e9s commerciales. Aidez-nous ! Mais attention, on signale aussi la pr\u00e9sence d'un Hermitaur Daimyo !",
    "flavor_es": "Los Hermitaur son una grave molestia... Se ocultan en la arena para emboscarnos, y no podemos hacer nada. \u00a1Ay\u00fadanos! Pero cuidado... hay un Daimyo Hermitaur.",
