    "flavor": "Gah! I was on my way back from some nice hot springs when BAM! I'm surrounded by Bulldrome -- angry ones! Visiting the inside of a gullet wasn't on my itinerary! Help get me outta here!",
    "flavor_de": "Pah! Ich war auf dem R\u00fcck- weg von einer hei\u00dfen Quelle, als ich *BAM!* von Bulldrome umzingelt war. Im Schlund einer Bestie zu landen, ist bestimmt nicht Teil meines Kurprogramms! Rette mich!",
    "flavor_fr": "Je rentrais des sources chaudes, quand des Bulldrome furieux me sont tomb\u00e9s dessus. Visiter un estomac n'\u00e9tait pas vraiment dans mes intentions. Aidez-moi \u00e0 filer d'ici !",
    "flavor_es": "\u00a1Bah! Volv\u00eda del balneario y de repente me rodearon Bulldrome. \u00a1Muy enfadados! Visitar un es\u00f3fago no entraba en mis planes. \u00a1Ay\u00fadame a salir de aqu\u00ed!",
    "flavor_it": "Ah! Stavo tornando da una fonte termale quando BAM! Sono stato circondato da Bulldrome! E infuriati, persino! Essere mangiato non era nei miei piani! Aiutami a uscire di qui!",
