    "flavor_fr": "J'ai retrouv\u00e9 la trace d'un ingr\u00e9dient l\u00e9gendaire dans les Pics brumeux ! Occupez-vous de cet Arzuros, et je r\u00e9colterai l'ingr\u00e9dient ! Nous ferons une patte de plus vers la concotion d'un nouveau plat !",
    "flavor_es": "\u00a1He divisado un ingrediente legendario en los Picos Nublados! \u00a1Mant\u00e9n ocupado al Arzuros, y podr\u00e9 ir a recogerlo! Estaremos una patita m\u00e1s cerca de un plato legendario.",
