    "flavor": "Ick! I got splattered with weird gunk that sapped my Stamina, so I couldn't even run! Luckily, a Felyne came by and saved me, but now whenever I see anything yellow...urgh!",
    "flavor_de": "Igitt! Ich bin von diesem seltsamen Glibber bedeckt, der meine Ausdauer angreift. Ich kann nicht mal laufen! Zum Gl\u00fcck wurde ich durch eine Felyne gerettet. Aber die Farbe gelb? Grauenhaft!",
    "flavor_fr": "Beurk ! Des \u00e9claboussures bizarres ont drain\u00e9 ma stamina et je ne pouvais plus courir ! Heureusement, un Felyne est venu m'aider. Maintenant, la seule vue du jaune me soul\u00e8ve le c\u0153ur !",
    "flavor_es": "\u00a1Bah! Me han salpicado con algo mugriento que me rob\u00f3 la resistencia. \u00a1No pod\u00eda ni correr! Por suerte, pas\u00f3 un Felyne y me salv\u00f3, pero ahora, si veo algo amarillo... \u00a1Argh!",
    "flavor_it": "Ick! Mi hanno ricoperto di una schifezza che ha assorbito la mia resistenza, quindi non riuscivo a correre! Un Felyne mi ha salvato, ma se ora vedo qualcosa di giallo... Bleah!",
