    "flavor_fr": "Se pr\u00e9sentant sous la forme d'une boule rouge ou d'un quadrup\u00e8de pesant, le Volvidon est l'une des nombreuses horreurs de la Fronti\u00e8re. Allez, Chasseur. Nettoyez la r\u00e9gion !",
    "flavor_es": "A veces es una bola roja, otras una enorme bestia de cuatro patas... Uno de los terrores de la Fronda: el Volvidon. Ve, cazador. Ya sabes qu\u00e9 hacer.",
    "flavor_it": "A volte \u00e8 una palla cremisi, a volte una goffa creatura con quattro zampe. \u00c8 uno dei pericoli della frontiera. \u00c8 il Volvidon! Vai, giovane leggenda, e mostra a tutti quanto vali!",
    "flavor_ja": "",
    "sub_reward": "600",
    "sub_hrp": "20"
