    "flavor": "The people here are gettin' rammed by Rhenoplos whenever they leave the village. They told me to take care of them, but you look strong enough. Go hunt some for me!",
    "flavor_de": "Sobald die Leute das Dorf verlassen, werden sie von Rhenoplos gerammt. Mir hat man gesagt, ich solle mich darum k\u00fcmmern, aber du siehst auch stark genug aus. Bitte jage welche f\u00fcr mich.",
    "flavor_fr": "Les gens se font charger par les Rhenoplos d\u00e8s qu'ils sortent du village. Je suis cens\u00e9 r\u00e9gler \u00e7a, mais je pr\u00e9f\u00e8re vous laisser faire. Alors, \u00e9liminez-en quelques-uns \u00e0 ma place !",
    "flavor_es": "Los Rhenoplos atacan a los aldeanos en cuanto salen. Me dijeron que me ocupara, pero t\u00fa pareces bastante fuerte. \u00a1Ve a cazar unos cuantos por m\u00ed!",
    "flavor_it": "La gente viene attaccata dai Rhenoplos appena mette piede fuori dal villaggio. Sono stato incaricato di risolvere la questione, ma tu mi sembri pi\u00f9 forte! Cacciane qualcuno per me!",
