    "flavor": "Yo, Hunter! Long tongues are weird, y'know what I'm sayin'? Especially Volvidon ones! But, y'know, it'd be interesting to see just how long they can get... I know! Go capture me one!",
    "flavor_de": "Lange Zungen sind total interessant! Besonders, wenn sie von einem Volvidon stammen. Ich m\u00f6chte wissen, wie lang die werden k\u00f6nnen. Bitte fange einen f\u00fcr mich!",
    "flavor_fr": "Je trouve \u00e7a trop bizarre, les langues. Surtout quand elles sont aussi longues que celles des Volvidon. J'aimerais trop voir combien elles mesurent en vrai. Vous m'en r\u00e9cup\u00e9rez une ?",
    "flavor_es": "\u00a1Oye, cazador! Las lenguas largas son raras, \u00bfsabes? Sobre todo las de Volvidon. Pero quiero saber lo largas que pueden ser... \u00a1Ya s\u00e9! \u00a1Ve a capturarme uno!",
    "flavor_it": "Ehil\u00e0! Le lingue lunghe sono strane, eh? Sai di cosa parlo, no? Come quelle del Volvidon! Sarebbe molto interessante sapere quanto possono allungarsi. Ci pensi tu a catturarne uno?",
