    "flavor": "Two new alphas joined the Genprey in the Dunes, and now the whole pack of 'em are acting up, and people are gettin' attacked! Time to downsize these bosses -- go wipe the pair out!",
    "flavor_de": "Zwei neue Alphatiere sind zu den Genprey in den D\u00fcnen gesto\u00dfen. Nun ist die Meute aufgeregt und greift die Menschen an. Wird Zeit, die zwei zurechtzustutzen. Schalte die beiden aus!",
    "flavor_fr": "L'arriv\u00e9e de deux nouveaux alphas a d\u00e9cupl\u00e9 la hargne des Genprey des Dunes et la meute attaque d\u00e9sormais sans crier gare. L'heure est venue pour vous d'\u00e9liminer ces deux g\u00eaneurs !",
