    "flavor": "While doing some business out in the Dunes, I heard about a route where livers go for a really high price. I can't ignore the scent of zenny to be made, so hurry and get me eight livers.",
    "flavor_de": "W\u00e4hrend ich in der W\u00fcste meinen Gesch\u00e4ften nachging, h\u00f6rte ich von einer Route, auf der Leber einen wirklich guten Preis bringt. Mich reizen die Zenny ja schon! Kannst du mir bitte 8 Lebern besorgen?",
