    "flavor": "In researching the mysteries of the Garuga King, I've come to the theory that the Yian Garuga is the key to solving it all. Hunt me one, and your name will go down in history! Under mine, of course.",
    "flavor_de": "Bez\u00fcglich des geheimnis- vollen Garuga-K\u00f6nigs bin ich mittlerweile \u00fcberzeugt, dass der Schl\u00fcssel zur L\u00f6sung bei den Yian Garuga liegt. Bitte bring mir einen! Das w\u00e4re der Durchbruch!",
    "flavor_fr": "L'\u00e9tude du roi Garuga pose bien des questions, et les Yian Garuga me semblent d\u00e9tenir la cl\u00e9 du myst\u00e8re. Trouvez-m'en un et votre nom entrera dans l'histoire. Apr\u00e8s le mien, bien s\u00fbr.",
