    "flavor": "My boss from hell is making me write up a report on Nargacuga eating habits! No way can I do that on my own! Can you go capture one for me, Hunter? I'll... I'll get the cage ready!",
    "flavor_de": "Mein teuflischer Chef l\u00e4sst mich einen Bericht \u00fcber das Nargacuga-Fressverhalten schreiben! Alleine schaffe ich das nie! Kannst du einen f\u00fcr mich fangen? Ich hol schon mal den K\u00e4fig, ja?",
