    "flavor_es": "Mi maldito jefe me ha mandado un informe sobre los h\u00e1bitos alimentarios del Nargacuga... \u00bfPodr\u00edas capturar uno para m\u00ed? \u00a1Yo preparar\u00e9 la jaula!",
