    "flavor": "The Nargacuga out on the Deserted Island is scarily fast. Blink and you'll miss it. But, Hunter, it's gotta go! There's nothing more important right now than hunting it, so get to it!",
    "flavor_de": "Der Nargacuga auf der \u00d6dnis- Insel ist f\u00fcrchterlich schnell. Man kann ihn leicht aus den Augen verlieren. Trotzdem muss das Biest weg! Das hat h\u00f6chste Priorit\u00e4t. Bitte unternimm etwas!",
