    "flavor_de": "Ich sch\u00e4tze, ich bin zu streng mit mir selbst. Ich bin bei Weitem nicht der einzige J\u00e4ger, der in den Nebelgipfeln durch den Zinogre zum Gejagten wurde. Warum sonst hei\u00dft er wohl \"Der J\u00e4ger\"? Trotzdem...",
