    "flavor_es": "Supongo que soy muy duro conmigo mismo. No soy el \u00fanico cazador cazado por el Zinogre de los Picos Nublados. \u00bfPor qu\u00e9 si no se conocer\u00eda a ese monstruo como \"el cazador\"? Aun as\u00ed...",
    "flavor_it": "Forse sono troppo duro con me stesso. Non sono il primo cacciatore che ha sfidato uno Zinogre sulle Cime nebbiose solo per diventare la sua preda. D'altra parte ci sar\u00e0 un motivo se viene chiamato \"Il cacciatore\"...",
