    "flavor_fr": "M\u00eame les marins les plus endurcis craignent les Lagiacrus. Or, l'une de ces cr\u00e9atures hante en ce moment la zone de p\u00eache de nos villageois ! Pour leur s\u00e9curit\u00e9, \u00e9liminez-la !",
    "flavor_es": "Hasta los marineros m\u00e1s curtidos temen al poderoso Lagiacrus. \u00a1Pues ahora ha aparecido uno en el caladero de nuestra aldea! \u00a1C\u00e1zalo, por favor!",
