    "flavor": "Did you hear that two giant Carapaceon appeared at the Volcano!? This is where you hunters leap into action, yeah? If you really are a hunter, then you'll be first in line to take out those beasts!",
    "flavor_de": "Zwei Carapaceon sind am Vulkan. Hast du davon geh\u00f6rt? Das ist doch ein Einsatzgebiet f\u00fcr euch J\u00e4ger, oder? Worauf wartest du? Sei der Erste, der diese Biester bek\u00e4mpft!",
    "flavor_fr": "Vous savez que deux Carapaceon g\u00e9ants ont \u00e9lu domicile sur le Volcan ? C'est un boulot pour les chasseurs, \u00e7a. Prouvez votre valeur en les \u00e9liminant avant vos rivaux !",
    "flavor_es": "\u00bfHas o\u00eddo que han aparecido dos carapaceon gigantes en el Volc\u00e1n? Es donde os toca intervenir, \u00bfno? Si eres realmente un cazador, te apuntar\u00e1s a destruirlos.",
    "flavor_it": "Hai sentito? Nel vulcano sono apparsi due carapaceon giganti! A voi cacciatori non dispiace andare in zona, vero? In questo caso, non ti dispiacer\u00e0 nemmeno abbattere quelle bestie!",
