    "flavor": "I was just minding my own business mining stuff when all of a sudden a Ceanataur shows up and bends my Iron Pickaxe clean in half! Rude! Go defeat 20 of them so I can resume my craft!",
    "flavor_de": "Ich war gerade am Sch\u00fcrfen, als ein Ceanataur auftauchte und meine eiserne Spitzhacke total verbog. Was f\u00fcr eine Unversch\u00e4mtheit! Bitte besiege 20 von ihnen, sonst bin ich ohne Arbeit!",
    "flavor_fr": "J'\u00e9tais tranquillement en train de creuser quand un Ceanataur a surgi de nulle part pour plier ma pioche ! Quelle impudence ! \u00c9liminez-en 20, que je puisse reprendre le travail !",
    "flavor_es": "Iba pensando en la mina cuando de repente sali\u00f3 un Ceanataur y me dobl\u00f3 el pico de hierro por el medio. \u00a1Qu\u00e9 groser\u00eda! Derrota a 20 de ellos para que pueda retomar lo m\u00edo.",
