    "flavor": "I was attacked by some monsters, but I played dead and fooled 'em all! All of 'em...except Uroktor and Remobras! Please, go out and slay them! My pride is at stake!",
    "flavor_de": "Ich wurde von Monstern angegriffen, doch ich konnte sie \u00fcberlisten, indem ich mich totstellte. Nur Uroktor und Remobras durchschauten mich. Bitte t\u00f6te sie. Sie k\u00f6nnten mich verraten!",
    "flavor_fr": "Des monstres s'en sont pris \u00e0 moi, mais j'ai r\u00e9ussi \u00e0 tous les duper en faisant le mort. Enfin, sauf les Uroktor et les Remobras. Je vous en prie, tuez-les. Il en va de ma fiert\u00e9 !",
    "flavor_es": "Me atacaron unos monstruos, pero me hice el muerto y los enga\u00f1\u00e9 a todos... Menos a los Uroktor y Remobra. Por favor, \u00a1ve a matarlos! \u00a1Est\u00e1 en juego mi honor!",
