    "flavor": "I saw a Volvidon attacked by a Brachydios at the Volcano! It got away, and now it's roaming dangerously close to my village! Can you hunt it for us? Keep an eye out for the Brachydios, too!",
    "flavor_de": "Ich sah, wie ein Volvidon von einem Brachydios angegriffen wurde. Ich konnte fliehen, doch nun ist er gef\u00e4hrlich nah am Dorf. Kannst du ihn jagen? Vergiss auch den Brachydios nicht!",
    "flavor_fr": "Un Brachydios a attaqu\u00e9 un Volvidon au Volcan ! Celui-ci a pris la fuite, mais tourne \u00e0 pr\u00e9sent autour du village ! Pourriez-vous le chasser ? Et attention au Brachydios, aussi !",
    "flavor_es": "Vi un Brachydios atacar a un Volvidon en el Volc\u00e1n. El Volvidon escap\u00f3, pero ahora se pasea muy cerca de la aldea. \u00bfPodr\u00edas cazarlo? Sin olvidarte del Brachydios, claro.",
