    "flavor": "Unexplained natural events have been occurring deep within the Jurassic Frontier. Intriguing, don't you think? I believe it's a sign of mythic beasts, but you should go see it with your own eyes.",
    "flavor_de": "Im Jura-Grenzland kam es zu unerkl\u00e4rlichen Natur- ph\u00e4nomenen. Faszinierend, nicht wahr? Ich denke, dass mythische Bestien dahinter- stecken. Am besten, du \u00fcberzeugst dich selbst.",
    "flavor_fr": "Des \u00e9v\u00e8nements myst\u00e9rieux ont lieu \u00e0 la Fronti\u00e8re jurassique. Troublant, non ? Il s'agit peut-\u00eatre de b\u00eates mystiques. Vous devriez aller voir par vous-m\u00eame.",
    "flavor_es": "En las profundidades de la Fronda Arcaica ocurren fen\u00f3menos inexplicables. Intrigante, \u00bfno te parece? Creo que es culpa de unas bestias m\u00edticas, pero deber\u00edas ir a verlo t\u00fa.",
