    "flavor": "My friends and I sought out a phantom beast. When we came upon it, we had but a moment before it smote us with thunder, casting us asunder. Please help us, Hunter.",
    "flavor_de": "Meine Freunde und ich suchten nach einer Phantom- kreatur. Als wir sie fanden, blieb uns nur ein Moment, bevor sie uns mit Donner \u00fcberzog und auseinander- riss. Bitte hilf uns, J\u00e4ger!",
    "flavor_fr": "Mes amis et moi cherchions une b\u00eate spectrale. Lorsque nous l'avons enfin trouv\u00e9e, elle nous a frapp\u00e9s avec sa foudre et nous a projet\u00e9s au loin. S'il vous pla\u00eet, venez-nous en aide !",
    "flavor_es": "Mis amigos y yo fuimos a por una bestia fantasmal. Cuando dimos con ella, enseguida nos atac\u00f3 con rayos y nos venci\u00f3. Ay\u00fadanos, por favor, cazador.",
    "flavor_it": "I miei amici e io cercavamo una bestia fantasma. Quando l'abbiamo trovata, tuttavia, ci ha colpito con un tuono, scaraventandoci via. Abbiamo bisogno del tuo intervento!",
