    "sub_goal_ja": "",
    "flavor": "I saw it! I know I did! A pair of black wings among a flurry of snow... Then a gust of wind nearly blew me off the mountain! Take my advice and don't even go near that thing!",
    "flavor_de": "Ich habe sie gesehen. Ganz sicher. Zwei schwarze Fl\u00fcgel im Schneegest\u00f6ber... Dann wurde ich fast vom Berg geweht. H\u00f6r auf meinen Rat und n\u00e4here dich diesem Ding erst gar nicht!",
    "flavor_fr": "Je l'ai vu ! Je le sais ! Des ailes noires dans la neige... Et puis, un coup de vent a failli me renverser ! Un bon conseil, ne vous approchez pas de cette cr\u00e9ature !",
    "flavor_es": "\u00a1Lo vi! \u00a1Estoy seguro! Un par de alas negras en medio de la r\u00e1faga de nieve. Luego, una r\u00e1faga de viento casi se me llev\u00f3 volando de la monta\u00f1a. Hazme caso, ni te acerques a esa cosa.",
    "flavor_it": "L'ho visto! Non ho alcun dubbio! Due ali nere in un turbine di neve! E un attimo dopo una raffica di vento stava per scaraventarmi via dalla montagna! Credimi, quel mostro \u00e8 inavvicinabile!",
