    "flavor": "I sensed a strong presence and turned around, but there was nobody there. There's no way anything could have sneaked up on us from our vantage point, but still... Keep your guard up, Hunter!",
    "flavor_de": "Ich sp\u00fcrte etwas Starkes hinter mir und drehte mich um, aber da war niemand. An unseren Aussichtspunkt kann sich keiner heranschleichen, aber trotzdem... Bleib in Deckung, J\u00e4ger!",
    "flavor_fr": "J'ai ressenti une forte pr\u00e9sence. Mais, regardant derri\u00e8re moi, je n'ai vu personne. Si on nous avait suivis, nous nous en serions aper\u00e7us... Gardez tout de m\u00eame l'\u0153il ouvert !",
    "flavor_es": "Not\u00e9 una presencia poderosa, pero al girarme no hab\u00eda nadie. No es posible que alguien nos sorprendiese por la espalda desde donde est\u00e1bamos y aun as\u00ed... \u00c1ndate con ojo.",
    "flavor_it": "Ho percepito nettamente una presenza e mi sono voltato, ma non c'era nessuno. Nulla avrebbe potuto coglierci alle spalle dalla nostra posizione, eppure... Tieni gli occhi aperti!",
