    "flavor": "I beg of you, help me in carrying out my last task. I've chased a Teostra to the Volcano. Beware its flames, for they may roast you alive if you are careless. Godspeed, Hunter!",
    "flavor_de": "Bitte hilf mir dabei, meine letzte Aufgabe zu erf\u00fcllen. Ich habe einen Teostra bis an den Vulkan verfolgt. H\u00fcte dich vor den Flammen, sie k\u00f6nnen leicht t\u00f6dlich sein. Geh mit Gott, J\u00e4ger!",
    "flavor_fr": "Aidez-moi \u00e0 accomplir ma derni\u00e8re t\u00e2che ! J'ai traqu\u00e9 un Teostra jusqu'au Volcan. Attention \u00e0 ses flammes, qui peuvent vous calciner en un rien ! Bonne chance, Chasseur !",
    "flavor_es": "Te lo ruego, ay\u00fadame a completar mi \u00faltima tarea. He perseguido a un Teostra hasta el Volc\u00e1n. Cuidado con sus llamas, pueden quemarte vivo si te descuidas. \u00a1Suerte, cazador!",
    "flavor_it": "Devo proprio chiedertelo: aiutami a portare a termine il mio ultimo incarico. Ho braccato un Teostra fino al vulcano. Occhio alle sue fiamme, per\u00f2... o brucerai in un attimo. Buona fortuna!",
