    "flavor": "I've only known the gods from their legends -- never did I expect to see one in my lifetime. Dare you attempt to halt the cycle of death and etch your own name into legend, Hunter?",
    "flavor_de": "Ich kenne die G\u00f6tter nur aus Legenden. H\u00e4tte nie gedacht, zu meinen Lebzeiten einen zu sehen. Wagst du es, den Kreislauf des Todes zu stoppen und deinen Namen zur Legende zu machen, J\u00e4ger?",
    "flavor_fr": "Je ne connais les dieux que par les l\u00e9gendes, je ne pensais pas en rencontrer un. Oserez-vous tenter de stopper le cycle de la mort et faire entrer votre nom dans la l\u00e9gende ?",
    "flavor_es": "Solo conoc\u00eda a los dioses a trav\u00e9s de leyendas... \u00a1No esperaba encontrarme uno en mi vida! \u00bfTe atreves a intentar interrumpir el ciclo de muerte y forjar tu leyenda, cazador?",
    "flavor_it": "Ho sentito molte leggende sugli dei, ma non mi sarei mai aspettato di vederne uno in carne e ossa. Avrai il coraggio di fermare questo ciclo di morte e di scolpire il tuo nome nella leggenda?",
