    "flavor_fr": "Ce primate d\u00e9go\u00fbtant a renvers\u00e9 mon chariot et crach\u00e9 du mucus partout ! Si \u00e7a continue, je vais changer de boulot. Aidez-moi, chasseur !",
    "flavor_es": "Ese primate asqueroso no hace m\u00e1s que liar estropicios, derribar mi carro y pringarlo todo de mocos. Si esto sigue as\u00ed, tendr\u00e9 que jubilarme. \u00a1\u00c9chame un cable, cazador!",
    "flavor_it": "Quel sudicio primate si arrampica dappertutto, rovesciandomi il carretto e imbrattandomi di muco! Se continua cos\u00ec, dovr\u00f2 cambiare mestiere. Aiutami tu, per favore!",
