    "flavor": "My training is complete, but now, monsters refuse to draw near. My mind and body yearn to test their strength! Honorable Hunter, bring me a Great Maccao that I may challenge!",
    "flavor_de": "Mein Training ist beendet, doch nun fehlen mir Monster. Sie meiden mich, doch ich sehne mich danach, mich mit ihnen zu messen. Bring mir bitte einen Gro\u00df-Maccao f\u00fcr ein Kr\u00e4ftemessen!",
    "flavor_fr": "Mon entra\u00eenement est enfin termin\u00e9, mais les monstres refusent de se montrer. Mon esprit et mon corps ne demandent qu'\u00e0 tester leur force ! Apportez-moi un Grand Maccao \u00e0 d\u00e9fier !",
    "flavor_es": "He acabado mi formaci\u00f3n, pero ahora los monstruos se niegan a acercarse. Quiero poner a prueba mi mente y mi cuerpo. Tr\u00e1eme un Gran Maccao para un duelo, honorable cazador.",
