    "flavor_fr": "Nous avons \u00e9conomis\u00e9 pour un petit lopin de terre dans la Steppe ancestrale, mais il est envahi par les Jaggi ! Je vous en prie, faites-les fuir, que je puisse y cultiver le jardin de mes r\u00eaves !",
    "flavor_es": "Ahorramos y nos compramos el terreno de nuestros sue\u00f1os cerca de la Estepa Oto\u00f1al, pero est\u00e1 infestado de Jaggi. \u00c9chalos, por favor, o nunca tendr\u00e9 el jard\u00edn que tanto deseo.",
