    "flavor": "I've been ferrying goods for a big deal coming up, only packs of Genprey keep messing things up. I'd bet there's an alpha behind it. Take 'em out so my deal won't fall through!",
    "flavor_de": "Beim Warentransport f\u00fcr ein wichtiges Gesch\u00e4ft kamen mir Genprey in die Quere. Bestimmt steckt da so ein Alpha dahinter. Mach sie unsch\u00e4dlich, damit mein Gesch\u00e4ft nicht scheitert!",
    "flavor_fr": "Je transporte de la marchandise pour un gros contrat, mais des Genprey m'attaquent sans cesse. Il doit y avoir un alpha dans la meute. Tuez-le ou mon contrat tombe \u00e0 l'eau.",
    "flavor_es": "Llevo mercanc\u00edas para un negocio importante, pero hay manadas de Genprey que me ponen las cosas dif\u00edciles. Apuesto a que hay un alfa detr\u00e1s. \u00a1Salva mi negocio! \u00a1M\u00e1talos!",
    "flavor_it": "Sto trasportando delle merci per un importante affare, ma un gruppo di Genprey mi tormenta. Scommetto che c'\u00e8 un alfa dietro! Devi farli fuori, altrimenti il mio accordo salter\u00e0!",
