    "flavor": "My luck is so bad lately. First a Gypceros swipes my Book of Combos, and then a Melynx runs off with my BBQ Spit! At this rate, I'm gonna have to quit hunting! Can you help me out here!?",
    "flavor_de": "Ich habe solch ein Pech in letzter Zeit. Erst stiehlt ein Gypceros mein Kombi- Buch und dann stibitzt eine Melynx meinen Grillspie\u00df. Wenn's so weitergeht, war's das f\u00fcr mich. Bitte hilf mir!",
    "flavor_fr": "J'ai une de ces poisses ! Un Gypceros m'a vol\u00e9 mon tome d'alchimie et un Melynx m'a d\u00e9rob\u00e9 ma broche BBQ ! \u00c0 ce rythme, je vais devoir abandonner la chasse ! Aidez-moi !",
    "flavor_es": "\u00daltimamente tengo muy mala suerte. Primero un Gypceros me roba el Libro combos, y despu\u00e9s un Melynx mi asador de barbacoa. A este paso, no podr\u00e9 cazar. \u00bfPodr\u00edas echarme una mano?",
    "flavor_it": "Bah, non \u00e8 proprio periodo! Prima un Gypceros ha rubato il mio libro alchimia, poi un Melynx mi ha fregato lo spiedo barbecue! Se continua cos\u00ec dovr\u00f2 smettere di cacciare! Puoi aiutarmi?",
