    "flavor": "My wife, bless her heart, went to the Primal Forest to pick me some of my favorite mushrooms, but was almost attacked by wyverns! Please, make the forest safe for her again!",
    "flavor_de": "Meine liebe Frau wollte im Ur-Wald f\u00fcr mich meine Lieblingspilze suchen und wurde dabei fast von Wyvern angegriffen. Bitte sorge daf\u00fcr, dass sie sich im Wald nicht mehr f\u00fcrchten muss.",
    "flavor_fr": "Ma ch\u00e8re et tendre \u00e9pouse est all\u00e9e cueillir mes champignons pr\u00e9f\u00e9r\u00e9s dans la For\u00eat primitive et a bien failli \u00eatre attaqu\u00e9e par des wyvernes ! Pourriez-vous y faire quelque chose ?",
    "flavor_es": "Mi esposa, bendita sea, fue a la Selva Jur\u00e1sica a por algunas de mis setas favoritas, pero casi la atacaron los wyverns. Por favor, \u00a1haz que la selva vuelva a ser segura!",
    "flavor_it": "Mia moglie, cuore d'oro, \u00e8 andata nella foresta primordiale a raccogliere i miei funghi preferiti, ma \u00e8 stata quasi attaccata dai wyvern! Ti prego, rendi la foresta sicura per lei!",
