    "flavor": "Research is my life! I'm currently studying the differences between Poison and Paralysis agents. Ioprey and Genprey are perfect for comparative analysis. Slay me a combined total of twenty!",
    "flavor_de": "Ich lebe f\u00fcr die Wissenschaft! Derzeit erforsche ich den Unterschied von giftigen zu l\u00e4hmenden Stoffen. Ioprey und Genprey sind ideal f\u00fcr den Vergleich. Erlege bitte insgesamt 20 f\u00fcr mich.",
    "flavor_fr": "La recherche, c'est ma vie ! J'\u00e9tudie la diff\u00e9rence entre les propri\u00e9t\u00e9s du Poison et de la Paralysie. Les Ioprey et les Genprey sont des cobayes parfaits. Tuez un total de vingt sp\u00e9cimens !",
    "flavor_es": "\u00a1Mis estudios son mi vida! Analizo las diferencias entre agentes venenosos y paralizantes. Ioprey y Genprey son perfectos para comparar. \u00a1Acaba con 20 entre los dos tipos!",
    "flavor_it": "La ricerca \u00e8 la mia vita! Sto studiando la differenza tra agenti paralizzanti e velenosi. Ioprey e Genprey sono perfetti per un'analisi comparativa. Per caso, puoi portarmene venti esemplari?",
