    "flavor": "Crystal Bones are a source of crucial data about ancient organisms and even modern biological phenomena! Please find me some to further my research, but don't forget to take a Pickaxe!",
    "flavor_de": "Kristallknochen sind eine Quelle f\u00fcr wichtige Daten \u00fcber uralte Organismen, selbst \u00fcber moderne Ph\u00e4nomene! Bitte besorge mir einige, aber vergiss deine Spitzhacke nicht!",
    "flavor_fr": "Les os en cristal sont une v\u00e9ritable mine d'informations sur les organismes anciens et les ph\u00e9nom\u00e8nes biologiques r\u00e9cents ! Trouvez-en pour mes recherches. N'oubliez pas d'emmener une pioche !",
    "flavor_es": "\u00a1Los huesos de cristal son una fuente crucial de datos sobre organismos primitivos, y hasta fen\u00f3menos biol\u00f3gicos modernos! Hazte con algunos y as\u00ed podr\u00e9 investigarlos. \u00a1No olvides llevar un pico!",
