    "flavor": "Dad was supposed to play outside with me today, but he said his head hurts! He said that some Slagtoth Oil could cure his \"hanged dover\" quick! Can you find us some? I wanna go play!",
    "flavor_de": "Papa wollte heute drau\u00dfen mit mir spielen. Aber nun hat er Kopfschmerzen! Er meint, dass Slagtoth-\u00d6l alle Katzen und Kater vertreibt. Kannst du das auftreiben? Ich m\u00f6chte spielen gehen!",
    "flavor_fr": "Papa devait jouer avec moi dehors aujourd'hui, mais il a la migraine. Il a dit que de l'huile de Slagtoth soignerait sa \"beule de guois\" ! Vous pourriez en trouver ? J'ai trop envie de jouer !",
    "flavor_es": "Se supon\u00eda que hoy pap\u00e1 jugar\u00eda conmigo, pero dijo que le dol\u00eda la cabeza. Un poco de aceite Slagtoth podr\u00eda curar su \"rebaca\". \u00bfPodr\u00edas encontrar un poco? \u00a1Quiero ir a jugar!",
    "flavor_it": "Pap\u00e0 doveva giocare con me, ma dice di avere mal di testa! Dice che dell'olio di Slagtoth potrebbe curare i suoi \"costumi della gonza\"! Puoi trovarcene un pochino? Io voglio giocare!",
