    "flavor": "Rock hard! That just about sums up what it's like to fight that thing and see your attacks bounce off those boulders it digs up... I give up! How about you, though? Up for a challenge?",
    "flavor_de": "Beinhart! So l\u00e4sst sich ein Kampf gegen dieses Ding am besten beschreiben. Angriffe prallen ab von den Fels- brocken, die es ausgr\u00e4bt. Ich gebe es auf. Und du? Suchst du Herausforderung?",
    "flavor_fr": "Dur, dur ! Voil\u00e0 l'effet que \u00e7a fait d'affronter cette b\u00eate et de voir sa lame ricocher sur les rochers qu'elle d\u00e9terre ! Je jette l'\u00e9ponge, mais vous pouvez tenter le coup. Chiche ?",
    "flavor_es": "\u00a1Como una roca! As\u00ed es como te sientes al luchar contra esa cosa, y ver que todos tus ataques rebotan en esas rocas que excava. \u00a1Me rindo! Pero, \u00bfy t\u00fa? \u00bfTe apetece un desaf\u00edo?",
