    "flavor": "You've seen Great Maccao hopping around on their tails and throwing punches, right? My notebook hasn't! At least, not until you go hunt two of them for me so I can make an accurate sketch!",
    "flavor_de": "Du hast gesehen, wie Gro\u00df- Maccaos auf dem Schwanz h\u00fcpfen und boxen, oder? In meinem Block fehlt davon noch eine Skizze. Bitte jage zwei f\u00fcr mich, damit ich ein Bild zeichnen kann!",
    "flavor_fr": "Vous avez vu des Grands Maccao bondir sur leur queue en d\u00e9cochant des coups de poing ? Moi non ! Si je veux pouvoir croquer ces cr\u00e9atures dans mon carnet, il faut que vous m'en chassiez deux !",
    "flavor_es": "Has visto c\u00f3mo los Gran Maccao saltan sobre sus colas y dan pu\u00f1etazos, \u00bfno? \u00a1Pues en mi libreta no salen! Al menos, hasta que caces a dos para que pueda dibujarlos.",
