    "flavor": "The Verdant Hills are littered with fiery goo and poison. The culprits are obvious, but we can't let them roam around freely. Forgive us, Hunter, but we ask you to please eliminate these two threats.",
    "flavor_de": "Die Gr\u00fcnen H\u00fcgel sind voller Feuerzeugs und Gifte. Die Schuldigen sind bekannt, aber wir k\u00f6nnen sie nicht einfach laufen lassen. J\u00e4ger, bitte beseitigt die zwei gef\u00e4hrlichen \u00dcbel.",
    "flavor_fr": "Les Collines verdoyantes sont couvertes de vase br\u00fblante et de poison. On conna\u00eet les coupables, il faut les emp\u00eacher de nuire ! Nous devons vous demander d'\u00e9liminer ces deux menaces.",
