    "flavor": "Young Hunter, your hands seem idle. Would you care to busy yourself collecting points for me in the Ancestral Steppe? Any items are fine, as long as you meet the quota. Take care, now.",
    "flavor_de": "Dir scheint irgendwie total langweilig zu sein. Magst du vielleicht f\u00fcr mich in der Ahnensteppe Punkte sammeln gehen? Die Objekte sind ganz egal, solange die Punktzahl stimmt. Und sei vorsichtig!",
