    "flavor": "A pack of Ioprey ain't nothin' I can't handle, but this was a giant horde. We would've been goners if we didn't call off the hunt. Take 'em down, will ya? Oh, and mind their poison.",
    "flavor_de": "Mit einem Rudel Ioprey w\u00e4re ich fertig geworden, aber das war eine gigantische Horde! Wir mussten die Jagd ein- fach abbrechen. Du kannst sie zur Strecke bringen, ja? Aber h\u00fcte dich vor dem Gift!",
    "flavor_fr": "Une meute d'Ioprey ne me pose g\u00e9n\u00e9ralement aucun probl\u00e8me. Mais cette fois, il y en avait une horde ! On a failli y rester. Vous pouvez vous en charger ? M\u00e9fiez-vous de leur poison !",
    "flavor_es": "Puedo ocuparme de los Ioprey, pero esta manada era enorme. Si no llegamos a suspender la cacer\u00eda, nos matan a todos. Acaba con ellos, pero ten cuidado con el veneno.",
    "flavor_it": "Un branco di Ioprey non \u00e8 un pericolo, ma questa era un'orda! Saremmo stati spacciati, se non ci fossimo ritirati. Riusciresti a farli fuori? Ma ricorda, fai attenzione al veleno!",
    "flavor_ja": "",
