    "flavor": "What a clever creature, confusing its prey before it sinks in its claws... Just like me! A quill pen made of one of its feathers would be the perfect symbol of my intelligence and class!",
    "flavor_de": "Schlau, wie diese Kreatur ihre Beute verwirrt, bevor sie die Klauen in ihr Fleisch schl\u00e4gt. Genau wie ich! Ach, h\u00e4tte ich doch eine Schreibfeder aus ihren Federn! Das w\u00e4re schick!",
    "flavor_fr": "Quelle cr\u00e9ature fut\u00e9e ! Elle trouble sa proie avant de planter ses griffes... comme moi ! Une plume de Malfestio serait le symbole par excellence de ma classe et de mon intelligence !",
    "flavor_es": "Qu\u00e9 criatura tan lista, confunde a su presa antes de clavarle las zarpas... \u00a1Como yo! Una pluma hecha con su plumaje ser\u00eda el s\u00edmbolo perfecto de mi clase y estirpe.",
    "flavor_it": "Che creatura intelligente. Confonde le sue prede prima di farle finire tra le sue grinfie... Proprio come me! Usare una delle sue piume per scrivere sarebbe un vero tocco di classe!",
