    "flavor": "My huntin' is near as bad as my dancin', but my little sis? Best moves in the tribe! I wanna make her a costume of serpent scales for the big festival. Could ya help me bag a big snake!?",
    "flavor_de": "Jagen und Tanzen sind nichts f\u00fcr mich, aber meine Schwester ist unsere beste T\u00e4nzerin! F\u00fcr das Fest will ich ihr ein Kost\u00fcm aus Schlangenschuppen schneidern. K\u00f6nntest du eine gro\u00dfe Schlange daf\u00fcr erlegen?",
    "flavor_fr": "Je suis presque aussi nul en chasse qu'en danse, mais ma petite s\u0153ur est la star de la tribu ! Je veux lui faire un costume en \u00e9cailles pour le festival. Vous m'attrapez un gros serpent ?",
    "flavor_es": "No s\u00e9 qu\u00e9 hago peor, cazar o bailar, pero mi hermanita es la bailarina de la tribu. Quiero hacerle un traje de escamas de serpiente para el gran festival. \u00bfPuedes ir a cazar una serpiente grande?",
    "flavor_it": "A ballare faccio pena quasi quanto nella caccia, ma la mia sorellina \u00e8 la migliore della trib\u00f9! Voglio cucirle un costume di scaglie di serpente per il festival. Me ne cacceresti uno?",
