    "flavor": "Beasts with lovely spots roam the Primal Forest. The patterns of Gendrome... Simply breathtaking. Hunt a few so I can see them up close, and I'll reward you with this Rainbow Ore.",
    "flavor_de": "Im Ur-Wald gibt es Tiere mit wunderbarer Fellzeichnung. Das Gendrome-Muster... Einfach atemberaubend. Ich m\u00f6chte sie mir aus der N\u00e4he ansehen. Jage welche und du bekommst Regenbogen-Erz.",
    "flavor_fr": "De belles cr\u00e9atures tachet\u00e9es errent dans la For\u00eat primitive. Les motifs des Gendrome sont... \u00e9poustouflants. Chassez-en afin que je puisse les \u00e9tudier. Je vous donnerai du minerai arc-en-ciel.",
    "flavor_es": "Bestias de bellos topos deambulan por la Selva Jur\u00e1sica. El pelaje del Gendrome... Impresionante. Caza unos cuantos y te dar\u00e9 mineral arco iris como recompensa.",
    "flavor_it": "Nella foresta primordiale ci sono mostri meravigliosi. I colori dei Gendrome... Da mozzare il fiato! Cacciane qualcuno e potr\u00f2 vederli pi\u00f9 da vicino. In cambio, avrai questo minerale arcobaleno.",
