    "flavor": "The uneducated masses call it a \"monster Sharq.\" What nonsense! It's a most magnificent creature, able to shift into so many forms... I must have a specimen for my research!",
    "flavor_de": "Ungebildete nennen ihn \"Monsterhai\". Aber was f\u00fcr ein Unfug! Eine gro\u00dfartige Kreatur, die so viele Formen annehmen kann. Ich brauche unbedingt ein Exemplar f\u00fcr meine Forschung!",
