    "flavor": "I was in the Frozen Seaway, I was, and that's when I felt it -- like me blood turned ta ice. Somethin' was a-spyin' on me. Cross me heart and hope ta die. Mind sussin' out the creepy peeper?",
    "flavor_de": "Ich war gerade beim Frostsee- weg, als ich es sp\u00fcrte. Mein Blut gefror fast zu Eis. Etwas beobachtete mich. Ich habe einen sechsten Sinn f\u00fcr so etwas, Ehrenwort! Kannst du dir das mal ansehen?",
    "flavor_fr": "J'\u00e9tais dans la Mer de glace quand j'ai senti mon sang se figer... Quelque chose me regardait. J'ai pri\u00e9, j'ai cru mourir. Vous voulez bien d\u00e9masquer le voyeur ?",
    "flavor_es": "Estaba en el Canal Helado y, de repente, lo sent\u00ed: fue como si se me helara la sangre. Algo me espiaba. Te lo juro por mis botas. \u00bfQuerr\u00edas echar un vistazo?",
    "flavor_it": "Ero al canale ghiacciato, quando ho sentito qualcosa... e il sangue mi si \u00e8 gelato nelle vene. Qualcosa mi stava osservando. Lo giuro sulla mia pellaccia. Scova quello spione, d'accordo?",
