    "flavor": "The Frozen Seaway sounds cold. I hate the cold! But, I am curious about the rabbit- like creatures that live there. Could you hunt some for me? No fewer than two, please! Ta-ta, now!",
    "flavor_de": "Frostseeweg: Das klingt eisig. Und ich hasse K\u00e4lte! Trotzdem bin ich neugierig auf die kaninchenartigen Kreaturen dort. Kannst du mir mindestens zwei von ihnen bringen?",
    "flavor_fr": "La Mer de glace doit \u00eatre glaciale ! Je hais le froid ! Mais j'aimerais en savoir plus sur les cr\u00e9atures lagomorphes qui y vivent. Pourriez-vous en chasser au moins deux ? Merci !",
    "flavor_es": "El Canal Helado suena fr\u00edo. \u00a1Odio el fr\u00edo! Pero me intrigan aquellas criaturas que parecen conejos que viven all\u00ed. \u00bfPodr\u00edas cazar algunos? Dos, como m\u00ednimo. Por favor. Andando, va.",
    "flavor_it": "Il canale ghiacciato \u00e8 troppo freddo. E io detesto il freddo! Tuttavia, sono interessato a quella specie di coniglio che vive l\u00ec. Puoi prenderne qualcuno per me? Non meno di due!",
