    "flavor": "I was out scouring the Frozen Seaway for harvest supplies when I was blindsided by these big, spiky beasts! I managed to get away, but it haunts me still... Someone dispatch the sneaky savages!",
    "flavor_de": "Ich war beim Frostseeweg auf Vorratssuche, als mich diese gro\u00dfen, stacheligen Biester \u00fcberfielen! Ich konnte entkommen, aber der Vorfall l\u00e4sst mich nicht mehr los... Jemand muss sie erledigen!",
    "flavor_fr": "Je parcourais la Mer de glace \u00e0 la recherche de denr\u00e9es quand j'ai \u00e9t\u00e9 attaqu\u00e9 par un de ces gros monstres \u00e0 pointes ! J'ai pu fuir, mais j'en tremble encore... Allez les chasser !",
    "flavor_es": "Estaba explorando el Canal Helado en busca de suministros cuando aquellas tres bestias me atacaron a traici\u00f3n. Consegu\u00ed escapar, pero a\u00fan tengo pesadillas. \u00a1Hay que acabar con ellas!",
    "flavor_it": "Perlustravo il canale ghiacciato alla ricerca di provviste e ho subito un'imboscata da questi mostri ricoperti di aculei! L'ho scampata per un soffio... Qualcuno deve farli fuori!",
