    "flavor": "The Frozen Seaway beats any tropical paradise for a geologist like me. Every day brings a new discovery! Did you know it's the only place you can find Bloodstones? I gotta get me some of that.",
    "flavor_de": "F\u00fcr Geologen wie mich schl\u00e4gt der Frostseeweg jedes Tropen- paradies. Jeden Tag kann man etwas Neues entdecken! Wusstest du, dass man nur da Blutsteine finden kann? Ich muss unbedingt welche haben.",
    "flavor_fr": "La Mer de glace surpasse tous les paradis tropicaux aux yeux d'un g\u00e9ologue. On y fait une d\u00e9couverte tous les jours ! Saviez-vous que c'\u00e9tait le seul endroit o\u00f9 on trouve des sanguines ?",
    "flavor_es": "Para un ge\u00f3logo, el Canal Helado es mejor que cualquier para\u00edso tropical. \u00a1Cada d\u00eda descubro cosas nuevas! \u00bfSab\u00edas que es el \u00fanico lugar donde hay hematitas? Quiero algunas.",
    "flavor_it": "Per una geologa come me, il canale ghiacciato \u00e8 un vero paradiso. Ogni giorno \u00e8 una nuova scoperta! Sapevi che \u00e8 l'unico luogo in cui puoi trovare pietre-sangue? Dovrei procurarmene qualcuna.",
