    "flavor_fr": "En grillade, frit avec des \u00e9pices et une sauce aigre-douce ou bouilli pour qu'il fonde en bouche... Mmm... \u00c7a me donne faim ! Rapportez-moi des boyaux de monstre, vous voulez bien ?",
    "flavor_es": "Ligeramente asado a la brasa, frito con salsa dulce y picante, hervido... Mmm... \u00a1me entra hambre solo con pensar en ello! \u00a1Tr\u00e1eme unas sabrosas tripas de monstruo!",
    "flavor_it": "Cotte alla brace, saltate con salsa piccante o bollite per ottenere la consistenza perfetta. Mmm... Mi viene fame solo a pensarci. Per favore, portami qualche deliziosa budella di mostro!",
