    "flavor": "Don't bother readin' any further unless you're a true hunter -- the type who loves that quiver in your guts when you're livin' on the razor's edge. Still with me? Go to the Volcano. Somethin's waitin'.",
    "flavor_de": "Nur f\u00fcr echte J\u00e4ger: Liebst du den Nervenkitzel, das Leben auf des Messers Schneide? Dann begib dich zum Vulkan. Dort wartet etwas auf dich.",
    "flavor_fr": "Inutile de continuer si vous n'\u00eates pas de ces chasseurs qui aiment vivre sur le fil du rasoir. Vous voyez ce que je veux dire ? Allez donc jusqu'au Volcan. Quelque chose vous y attend.",
    "flavor_es": "No te molestes en seguir leyendo si no eres un cazador de los que se emocionan por dentro cuando corren peligro. \u00bfSigues leyendo? Pues ve al volc\u00e1n, y ver\u00e1s.",
    "flavor_it": "Non leggere oltre a meno che tu non sia un cacciatore che ama vivere pericolosamente! Sei ancora qui? Ok, allora recati al vulcano. C'\u00e8 qualcosa che ti aspetta!",
