    "sub_goal_ja": "",
    "flavor": "Ugh... I think I was a little too ambitious to try climbing the Volcanic Hollow. I forgot my Cool Drinks and ran out of Stamina. Worst of all, I was attacked by a Yian Garuga. Somebody help me, please!",
    "flavor_de": "Uff, mit der Klettertour auf die Vulkanmulde habe ich mich wohl \u00fcbernommen. Ich zog ohne Kaltgetr\u00e4nke los und meine Ausdauer reichte nicht. Ich brauche Hilfe gegen den Yian Garuga!",
    "flavor_fr": "Pff... Grimper le Vallon volcanique \u00e9tait trop ambitieux pour moi. J'ai oubli\u00e9 mes boissons fra\u00eeches et \u00e9puis\u00e9 ma stamina. Pire encore, un Yian Garuga a d\u00e9cid\u00e9 de m'attaquer. \u00c0 l'aide !",
    "flavor_es": "Ugh... Creo que me pas\u00e9 de ambicioso al intentar subir al Hoyo Volc\u00e1n. Olvid\u00e9 mis bebidas fr\u00edas y se me acab\u00f3 la resistencia. Y encima me atac\u00f3 un Yian Garuga. \u00a1Que alguien me ayude!",
    "flavor_it": "Ugh! Credo di essere stato troppo ambizioso cercando di scalare la fossa vulcanica. Ho dimenticato le bevande, esaurito la resistenza e mi ha persino attaccato uno Yian Garuga! Aiutami!",
