    "flavor": "Oh, the horror! Oh, the zenny! Apparently, a Tetsucabra is making a mess of some newly developed land. Big reward on its head, I hear. Help me and we'll split it fifty-fifty!",
    "flavor_de": "Oh Graus! Oh Zenny! Offenbar verw\u00fcstet ein Tetsucabra ein neu erschlossenes St\u00fcck Land. Auf seinen Kopf wurde eine hohe Belohnung ausgesetzt, wie ich h\u00f6rte! Hilf mir, dann k\u00f6nnen wir halbe-halbe machen!",
    "flavor_fr": "Quelle horreur ! Il semblerait qu'un Tetsucabra ravage des territoires r\u00e9cemment d\u00e9velopp\u00e9s. Celui qui l'\u00e9liminera recevra une grosse r\u00e9compense. Aidez-moi, on partagera !",
    "flavor_es": "\u00a1Qu\u00e9 horror! \u00a1Oh, los zenis! Al parecer, un Tetsucabra anda armando jaleo en una tierra reci\u00e9n cultivada. Hay una gran recompensa por su cabeza. \u00a1Ay\u00fadame y podemos repart\u00edrnosla!",
    "flavor_it": "Oh, paura! Oh, zenny! Pare che un Tetsucabra stia seminando scompiglio in nuovi territori. C'\u00e8 una grossa taglia sulla sua testa. Aiutami e faremo a met\u00e0!",
