    "flavor": "If I don't have Coal to roast tonight's feast, my goose is cooked! Actually, it won't be cooked, but I'll still end up in hot water. Er, not literally. Oh, just help me, will you!?",
    "flavor_de": "Ich habe keine Kohle zum Garen des Festmahls heute Abend. Man wird mich r\u00f6sten! Na gut, nicht buchst\u00e4blich, aber die Finger verbrenne ich mir trotzdem. Nat\u00fcrlich auch nicht w\u00f6rtlich... Ach, hilf mir bitte einfach, ja?",
    "flavor_fr": "Si je n'ai pas de charbons pour faire r\u00f4tir le d\u00eener de ce soir, je suis cuit ! Contrairement \u00e0 mes plats, on peut dire. Aidez-moi, je vous en prie !",
    "flavor_es": "\u00a1Si no tengo carb\u00f3n para asar el fest\u00edn de esta noche, me asar\u00e1n vivo! Bueno, en realidad no podr\u00e1n, porque no hay carb\u00f3n, pero ya me entiendes, \u00bfverdad?. Ay\u00fadame, por favor.",
