    "flavor": "This is the kind of Quest that the G Rank hunters that used to come to Pokke would finish in their SLEEP! You look like you're at least half-awake, so it should be no sweat for you! Good luck!",
    "flavor_de": "Diese Art von Quest haben die G-Rang-J\u00e4ger in Pokke quasi im SCHLAF erledigt! Du siehst zumindest so halbwach aus, von daher solltest du dir keine Sorgen machen. Viel Gl\u00fcck!",
    "flavor_fr": "\u00c0 l'\u00e9poque, au village Pokke, je confiais des qu\u00eates \u00e0 l'\u00e9lite ! Aujourd'hui, je vous confie celle-ci ! Elle n'est pas de tout repos, mais vous l'appr\u00e9cierez, j'en suis s\u00fbre. Bonne chance !",
    "flavor_es": "\u00a1Los cazadores de rango G que antes ven\u00edan a Pokke har\u00edan esta misi\u00f3n con los ojos cerrados! T\u00fa tambi\u00e9n pareces medio decente, as\u00ed que no deber\u00eda costarte mucho. \u00a1Buena suerte!",
    "flavor_it": "Ai miei tempi, al villaggio di Pokke offrivo missioni alla cr\u00e8me de la cr\u00e8me! Indi per cui, oggi ti presento QUESTA! \u00c8 impegnativa, non posso negarlo, ma non dubito che sar\u00e0 uno spasso per te!",
