    "flavor": "My wife gave me a Malfestio to help me deal with insomnia, but one doesn't seem to be enough. I'm also afraid that using two at once may have some ill side effects. Could you test it out for me?",
    "flavor_de": "Meine Frau meinte, ein Mal- festio k\u00f6nne mich von meiner Schlaflosigkeit heilen, aber vermutlich brauche ich min- destens zwei. Kannst du aus- probieren, ob es bei zweien Nebenwirkungen gibt?",
    "flavor_fr": "Mon \u00e9pouse m'a donn\u00e9 un Malfestio pour m'aider \u00e0 trouver le sommeil, mais \u00e7a ne suffit pas. Et j'ai peur des effets secondaires si j'en utilise deux. Vous voulez bien essayer pour moi ?",
    "flavor_es": "Sufro insomnio, y mi mujer me dio un Malfestio para ayudarme, pero con uno no basta. Y temo que dos podr\u00eda resultar demasiado... \u00bfPodr\u00edas probarlo por m\u00ed?",
    "flavor_it": "Mia moglie mi ha dato un Malfestio per aiutarmi con l'insonnia, ma uno non sembra essere sufficiente. Con due temo possibili effetti collaterali. Puoi testarne due insieme per me?",
