    "flavor": "Sandboarding! It's the latest craze! ...Or it will be, as soon as I finish inventing it. But I can't do anything with these darned Cephadrome in the way. Get rid of 'em and I'll give you some Rainbow Ore!",
    "flavor_de": "Sandboarding! Der neueste Trend! Jedenfalls, sobald ich es 100%-ig erfunden habe. Aber leider machen mir diese vermaledeiten Cephadrome das Erfinden schwer. Sind sie weg, gibt's Regenbogen-Erz.",
    "flavor_fr": "Le surf sur sable ! C'est la nouvelle mode ! Enfin, \u00e7a le sera d\u00e8s que j'aurai fini de l'inventer. Mais ces fichus Cephadrome m'en emp\u00eachent. Faites-les dispara\u00eetre et vous aurez du minerai arc-en-ciel !",
    "flavor_es": "\u00a1El surf de arena es lo \u00faltimo! O lo ser\u00e1 en cuanto lo tenga inventado. Pero no puedo hacer nada con esos malditos Cephadrome. \u00a1L\u00edbrame de ellos y te dar\u00e9 mineral arco iris!",
    "flavor_it": "Il sandboarding impazza! O almeno, lo far\u00e0 quando avr\u00f2 finito di inventarlo. Ma non posso farlo finch\u00e9 quei Cephadrome mi staranno tra i piedi. Eliminali e ti dar\u00f2 del minerale arcobaleno!",
