    "flavor": "Dang Rathian! Ambushed my caravan and tore my business a new one! But I ain't the gettin' mad type, I'm the gettin' even type! Time for some ice cold revenge, and I want you to dish it out!",
    "flavor_de": "Verdammte Rathian! Lauerte tats\u00e4chlich meiner Karawane auf und vermasselt mir das Gesch\u00e4ft! Aber da hat sie sich verrechnet! Ich will Rache und du sollst sie in meinem Namen ausf\u00fchren!",
    "flavor_fr": "Salet\u00e9 de Rathian ! Elle a attaqu\u00e9 ma caravane et saccag\u00e9 ma marchandise ! Au lieu de m'\u00e9nerver, je vais lui rendre la pareille. La vengeance est un plat qui se mange froid !",
    "flavor_es": "\u00a1Rathian Maldita! Nos tendi\u00f3 una emboscada y destroz\u00f3 mi negocio. Pero voy a enfadarme, \u00a1voy a vengarme! La venganza es un plato que se sirve fr\u00edo, y t\u00fa lo cocinar\u00e1s.",
    "flavor_it": "Dannata Rathian! Ha sorpreso la mia carovana e mandato in rovina i miei affari! Ma io non sono il genere di leader che s'infuria... Potresti servirle una bella vendetta \"fredda\" per me?",
    "flavor_ja": "",
