    "flavor_fr": "Un Blangonga s\u00e8me le chaos sur l'un de mes itin\u00e9raires. Pourriez-vous r\u00e9gler le probl\u00e8me ? Je vous donnerai des coccinelles g\u00e9antes que vous pourrez utiliser comme mat\u00e9riaux d'\u00e9quipement !",
    "flavor_es": "Un Blangonga est\u00e1 sembrando el caos en una de mis rutas. \u00bfPodr\u00edas ocuparte de \u00e9l? Te dar\u00e9 mariquitas gigantes que te servir\u00e1n como materiales para equipo.",
