    "flavor": "A Plesioth! In the Misty Peaks! And I would have had it, too, if not for its water breath and hiding in the river all the time... I didn't have my bathing suit! I'll let you deal with it!",
    "flavor_de": "Da war er! Ein Plesioth! In den Nebelgipfeln! Fast h\u00e4tte ich ihn erwischt, aber er versteckte sich unter Wasser im Fluss. Ich hatte doch keine Schwimmsachen dabei! K\u00fcmmere dich bitte um ihn!",
    "flavor_fr": "Un Plesioth ! Dans les Pics brumeux ! J'aurais pu lui r\u00e9gler son compte s'il avait sorti la t\u00eate de l'eau... Je n'avais pas pris mon maillot ! Je vous laisse vous en charger, d'accord ?",
    "flavor_es": "\u00a1Un Plesioth en las Picos Nublados! Y me habr\u00eda ocupado de \u00e9l, si no fuese por el aliento de agua y que se escond\u00eda en el r\u00edo. \u00a1Yo no llevaba ba\u00f1ador! M\u00e1s vale que te ocupes t\u00fa.",
    "flavor_it": "Un Plesioth! Sulle cime nebbiose! Oh, lo caccerei volentieri io, non fosse per gli spruzzi d'acqua e il suo incessante \"nascondino\". Non ho il costume da bagno, sai! Ma puoi occupartene tu!",
