    "flavor": "The Loc Lac Tourism Board will not sit idly by as this Plesioth eats into our tourism revenues. We would like you to deal with this nuisance and help our other guests return home safely.",
    "flavor_de": "Das Loc-Lac-Touristenb\u00fcro wird nicht zulassen, dass Plesioths unsere Einnahmen schm\u00e4lern. Bitte k\u00fcmmere dich um dieses \u00c4rgernis und hilf unseren anderen G\u00e4sten sicher heimzukehren.",
    "flavor_fr": "L'office du tourisme de Loc Lac ne restera pas les bras crois\u00e9s alors que ces Plesioth nous font perdre nos b\u00e9n\u00e9fices. Nous voulons \u00e9radiquer ce probl\u00e8me et aider nos autres clients \u00e0 rentrer sains et saufs.",
    "flavor_es": "La Junta de Turismo de Loc Lac no se quedar\u00e1 con los brazos cruzados mientras esos Plesioth nos arruinan. Por favor, elim\u00ednalos y ayuda a nuestros hu\u00e9spedes a volver a casa.",
    "flavor_it": "L'ente turistico di Loc Lac non rimarr\u00e0 inerte mentre questi Plesioth distruggono il turismo. Vorremmo che ci liberassi di questa grana per permettere ai nostri ospiti di tornare a casa.",
