    "flavor": "Ioprey ain't nothin' I can't handle, but this pack had two bosses. I couldn't pin 'em down and they got away, but if you can take 'em down for me, I'll give you some Rainbow Ore.",
    "flavor_de": "Ioprey sind normalerweise leichte Beute, aber diese Meute hatte zwei Anf\u00fchrer. Ich konnte sie einfach nicht festnageln und sie flohen, aber wenn du sie erwischst, gebe ich dir Regenbogen-Erz.",
    "flavor_fr": "En temps normal, les Ioprey ne me posent aucun probl\u00e8me, mais cette meute comptait deux chefs. Ils m'ont \u00e9chapp\u00e9, mais si vous vous en chargez, je vous donnerai du minerai arc-en-ciel.",
    "flavor_es": "Puedo ocuparme de los Ioprey, pero esta manada ten\u00eda dos jefes. No logr\u00e9 atraparlos y se escaparon, pero si puedes derribarlos por m\u00ed, te dar\u00e9 un poco de mineral arco iris.",
    "flavor_it": "Uno Ioprey \u00e8 un gioco da ragazzi, ma questo branco ha due leader, e non sono riuscito a bloccarli. Se potessi abbatterli al posto mio ti ricompenserei con del minerale arcobaleno.",
