    "flavor": "My village has a huge bug problem. We're talkin' like Bugtopia here! If you can help us out by squashing about 50 of them, that'd help us a lot. Just watch out for any big monsters!",
    "flavor_de": "Mein Dorf hat ein K\u00e4fer- problem, schlimmer als ein Weltuntergang! Wenn du 50 von ihnen zerquetschen k\u00f6nntest, w\u00e4re uns sehr geholfen. Aber pass auf die gro\u00dfen Monster auf!",
    "flavor_fr": "Mon village est envahi par les insectes ! Si vous pouviez nous aider \u00e0 en \u00e9craser une cinquantaine, ce serait parfait ! Mais n'oubliez pas de faire attention aux gros monstres !",
    "flavor_es": "Mi pueblo est\u00e1 infestado de bichos. \u00a1Se comportan como si fuesen los reyes! Si pudieses matar a unos 50, nos ayudar\u00edas mucho. \u00a1Pero cuidado con los monstruos grandes!",
