    "flavor": "So my brother thinks he's the best fisher in our castle. We'll see about that! Catch me a Lavasioth and I can prove him wrong! I'm a genius! Now, off you go. Don't keep me waiting!",
    "flavor_de": "Mein Bruder glaubt, er sei der beste Fischer der Burg. Von wegen! Fang f\u00fcr mich ein Lavasioth als Beweis, dass er falsch liegt. Ich bin ein Genie! Beeil dich. Lass mich nicht warten!",
    "flavor_fr": "Mon fr\u00e8re se dit le meilleur p\u00eacheur du ch\u00e2teau ! On va bien voir ! Attrapez-moi un Lavasioth et je lui montrerai que c'est moi la meilleure ! Je suis g\u00e9niale ! Allez, filez. Et ne me faites pas attendre !",
    "flavor_es": "As\u00ed que mi hermano se cree el mejor pescador del castillo. \u00a1Ja! Eso est\u00e1 por ver. P\u00edllame un Lavasioth para demostrarle que no. \u00a1Qu\u00e9 gran idea! Anda, ve. \u00a1No me tengas en ascuas!",
    "flavor_it": "Mio fratello crede di essere il miglior pescatore del castello! Ah, la vedremo! Cacciami un Lavasioth e gli dimostrer\u00f2 che si sbaglia! Sono un genio! Ora vai, non farmi aspettare!",
