    "flavor": "Holy moly! Have you seen one of those things before? I thought it was a giant boulder tumbling down the mountain, but no, it was a monster comin' to eat me! I'm not going back there until you get rid of it!",
    "flavor_de": "Heiliger Strohsack! Hast du so etwas schon mal gesehen? Ich dachte, ein Fels rollt den Berg hinab, dabei war es ein Monster, das mich fressen wollte! Du musst es beseitigen!",
    "flavor_fr": "Bon sang ! Vous avez vu ces bestioles ? J'ai cru qu'un gros rocher d\u00e9boulait de la montagne, mais non ! C'\u00e9tait un monstre venu me d\u00e9vorer. Je n'y retournerai pas tant que vous ne l'aurez pas tu\u00e9 !",
    "flavor_es": "\u00a1Santo cielo! \u00bfHab\u00edas visto jam\u00e1s algo as\u00ed? Pens\u00e9 que era una roca desprendida de la monta\u00f1a, pero era un monstruo que me quer\u00eda comer. \u00a1No pienso volver hasta que te libres de \u00e9l!",
    "flavor_it": "Santo cielo! Avevi mai visto una di quelle belve? Pensavo fosse un macigno, invece era un mostro intenzionato a mangiarmi! Non torner\u00f2 l\u00ec finch\u00e9 non me l'avrai tolto dai piedi!",
