    "flavor": "Hours of walking through a sweltering cave, only to find ourselves in the Volcano, swooped down upon by a giant Ceanataur! We may make weapons, but we're still merchants. Help!",
    "flavor_de": "Ein stundenlanger Marsch durch eine gl\u00fchend hei\u00dfe H\u00f6hle, nur um mitten in einem Vulkan auf einen riesigen Ceanataur zu sto\u00dfen! Dabei sind wir doch H\u00e4ndler! Hilf uns bitte!",
    "flavor_fr": "On a march\u00e9 des heures dans une grotte \u00e9touffante, pour finir dans le Volcan, attaqu\u00e9s par un Ceanataur g\u00e9ant ! On fabrique peut-\u00eatre des armes, mais on n'est que des marchands ! \u00c0 l'aide !",
    "flavor_es": "Horas andando en una cueva sofocante, solo para llegar al Volc\u00e1n arrastrados por un Ceanataur gigante. Fabricamos armas, pero solo somos mercaderes. \u00a1Ay\u00fadanos!",
    "flavor_it": "Ore di marcia in una caverna soffocante, e solo per ritrovarci nel vulcano, alle prese con un Ceanataur gigante! Produciamo armi, \u00e8 vero, ma alla fine siamo solo dei mercanti. Aiutaci!",
