    "flavor": "For a year I researched safe hunting practices: Antidotes, anti-Paralysis, you name it. The results of my research? The safest hunt...is one you've pushed off onto someone else! Good luck!",
    "flavor_de": "Ein Jahr lang betrieb ich Forschung f\u00fcr eine sichere Jagd: Gegengifte und Arz- neien. Einfach alles. Und meine Erkenntnis? Am sicher- sten ist die Jagd, wenn man andere schickt. Viel Gl\u00fcck!",
    "flavor_fr": "J'ai consacr\u00e9 un an \u00e0 l'\u00e9tude de m\u00e9thodes de chasse s\u00fbres. Anti-paralysie, antidotes, j'en passe. R\u00e9sultat ? La forme de chasse la plus s\u00fbre... consiste \u00e0 envoyer quelqu'un \u00e0 sa place !",
    "flavor_es": "Llevo un a\u00f1o estudiando pr\u00e1cticas de caza segura. Ant\u00eddotos, antipar\u00e1lisis... \u00bfMis resultados? Que la cacer\u00eda segura es la que hacen otros por ti. \u00a1Buena suerte!",
