    "flavor_de": "Legenden erz\u00e4hlen von einem fernen Land, wo man K\u00e4fer kocht und isst. Ich h\u00f6rte, eine Seltas-K\u00f6nigin wurde in der N\u00e4he gesehen. Klingt k\u00f6stlich! Hm? Wie der letzte K\u00e4fer war, den ich a\u00df? Kein Kommentar...",
    "flavor_fr": "On dit que dans une r\u00e9gion lointaine, les gens mangent des insectes bouillis. \u00c7a a l'air d\u00e9licieux ! Une Reine Seltas a \u00e9t\u00e9 rep\u00e9r\u00e9e pr\u00e8s d'ici, vous voulez bien y aller pour moi ?",
    "flavor_es": "Cuenta la leyenda que, en una tierra lejana, cuecen bichos y se los zampan. Creo que hay una Seltas Reina cerca. \u00a1Qu\u00e9 rica! \u00bfQue si me gust\u00f3 el bicho anterior? \u00a1Sin comentarios!",
    "flavor_it": "Pare che in una landa lontana bolliscano e mangino insetti. Sembra che una Seltas regina sia apparsa nelle vicinanze. Deliziosa! Eh? Com'era l'ultimo insetto che ho assaggiato? No comment.",
