    "flavor_fr": "Gore Magala... Son nom fait pleurer les hommes. Ne vous attendez pas \u00e0 une partie de chasse sympa, avec lui tout n'est que t\u00e9n\u00e8bres. Pouvez-vous \u00e9loigner ce d\u00e9mon implacable ?",
