    "flavor_it": "Gore Magala... \u00c8 sufficiente il nome per far fuggire anche gli uomini veri dalle loro mamme. Il miasma nero che emana avvolge ogni cosa. Sar\u00e0 dura. Riuscirai ad allontanare questa creatura malvagia?",
