    "flavor": "Legends tell of a faraway land where the people turn insects into hors d'oeuvres. For my final request, hunt me a Seltas Queen so I can try a taste. This is the last time I'll ask, promise!",
    "flavor_de": "Legenden erz\u00e4hlen von einem fernen Land, wo man Insekten zu Vorspeisen verarbeitet. Jage Er eine Seltas-K\u00f6nigin f\u00fcr mich, damit ich sie kosten kann. Das ist meine letzte Bitte an Ihn, versprochen!",
    "flavor_fr": "On dit que dans une r\u00e9gion lointaine, les gens mangent des insectes \u00e0 l'ap\u00e9ritif. Allez chasser une Reine Seltas pour que je puisse y go\u00fbter. C'est ma derni\u00e8re demande, promis !",
    "flavor_es": "Las leyendas hablan de una tierra lejana en la que usan insectos para preparar canap\u00e9s. Caza una Seltas Reina para que pueda probar este plato. \u00a1Ya no te pedir\u00e9 nada m\u00e1s, de veras!",
