    "flavor": "That little moss-covered hill at the Misty Peaks was just begging to be painted. But the second I pulled out my easel and brush, it was gone! How can I be a landscape artist if the landscape won't cooperate?",
    "flavor_de": "Dieser kleine, moosbewachsene H\u00fcgel der Nebelgipfel schrie nach einem Bild. Als ich meine Staffelei aufgestellt hatte, war er verschwunden! Wie soll ich Landschaften malen, wenn die Landschaft nicht mitmacht?",
