    "flavor_es": "Esa colina verde de los Picos Nublados ped\u00eda a gritos que la pintara. Fue sacar el pincel y el lienzo, \u00a1y ya no estaba! \u00bfC\u00f3mo puedo ser paisajista si el paisaje no me ayuda?",
