    "flavor": "I heard the Primal Forest had some big bugs, so I went to check it out, but something put me to sleep and I woke up covered in bubbles! Could you go look for the bugs instead?",
    "flavor_de": "Ich habe geh\u00f6rt, dass die K\u00e4fer im Ur-Wald sehr gro\u00df seien. Das wollte ich sehen, aber irgendetwas hat mich bet\u00e4ubt. Als ich erwachte, war ich von Bl\u00e4schen bedeckt. Suchst du nach den K\u00e4fern?",
    "flavor_fr": "On dit que la For\u00eat primitive abrite de gros insectes. J'ai voulu le voir de mes yeux. Mais j'ai perdu connaissance et \u00e0 mon r\u00e9veil, mon corps \u00e9tait couvert de bulles ! Vous pourriez trouver ces insectes ?",
    "flavor_es": "O\u00ed que en la Selva Jur\u00e1sica hay insectos enormes, as\u00ed que fui a ver, pero algo me hizo caer dormido y me despert\u00e9 cubierto de burbujas. \u00bfPodr\u00edas ir t\u00fa a por los insectos?",
    "flavor_it": "Sembra che nella foresta primordiale ci siano degli insetti enormi. Sono andato a vedere, ma qualcosa mi ha addormentato e mi sono svegliato coperto di bolle! Puoi andare a controllare?",
