    "flavor_fr": "Nous devions faire une belle excursion pour voir l'aurore, mais nous n'avons vu que des monstres ! Aucune merveille ne m\u00e9rite de risquer sa vie ! Chassez ces monstres et nous pourrons terminer notre balade.",
    "flavor_es": "Se supon\u00eda que \u00edbamos a ver la aurora boreal, pero solo hemos visto monstruos. \u00a1No vale la pena arriesgar la vida! Por favor, \u00a1dales caza para que podamos seguir con nuestro viaje!",
    "flavor_it": "Avevamo in programma un tour per ammirare l'aurora, ma qui non ci sono altro che mostri! Non voglio rischiare la vita! Ti prego, caccia le bestie e potremo concludere il nostro giro turistico!",
