    "flavor_fr": "Mon rayon, c'est l'\u00e9tude des munitions. Eh oui, c'est un m\u00e9tier ! J'analyse les attaques \u00e0 distance des monstres et je d\u00e9veloppe des outils pour les combattre. En m'aidant, c'est vous-m\u00eame que vous aidez.",
    "flavor_es": "Soy investigador de balas. Profesional, s\u00ed. Estudiamos los ataques a distancia de los monstruos para dise\u00f1ar armas mejores para luchar contra ellos. \u00a1Ayudarme es ayudarte a ti mismo!",
