    "flavor": "I heard some monsters were making a mess at the Volcano, so I'm like BAM! Let me at 'em! But then they were like BAM! No way, bro! I can't let them burn me like that, man! Please, avenge me!",
    "flavor_de": "Ich h\u00f6rte, dass Monster am Vulkan unterwegs seien. Bin also sofort hin. BAM! Die kauf ich mir! Aber schwerer Irrtum! Ging komplett nach hinten los! Was f\u00fcr eine Schande! Bitte r\u00e4che mich!",
    "flavor_fr": "J'ai appris qu'un monstre semait le chaos au Volcan et j'ai dit : \"OUAIS ! Je vais lui r\u00e9gler son compte !\". On m'a r\u00e9pondu : \" NON ! Pas question !\". Je ne me laisserai pas faire ! Vengez-moi !",
    "flavor_es": "He o\u00eddo que un monstruo est\u00e1 causando problemas en el Volc\u00e1n, as\u00ed que yo, \u00a1bam!, voy a por todas. \u00a1Pero ni hablar! No puedo permitir que me quemen as\u00ed. \u00a1V\u00e9ngame, por favor!",
    "flavor_it": "Sembra che dei mostri stiano creando problemi al vulcano, perci\u00f2 BAM! mi precipito l\u00ec. Ma poi loro BAM! niente da fare! Non posso lasciare che mi brucino cos\u00ec! Per favore, BAM! vendicami!",
