    "flavor_de": "Es hei\u00dft, irgendwo in der Welt w\u00fcrden Monster aus der Urzeit frei herumstreifen. Ich habe Leib und Leben riskiert, um diesen Ort zu finden. Und jetzt zeige ich dir, wie man dorthin kommt!",
    "flavor_fr": "On raconte qu'il existe un endroit o\u00f9 les monstres d'antan r\u00f4dent en toute libert\u00e9. J'ai risqu\u00e9 ma vie pour trouver ce lieu. Et \u00e0 pr\u00e9sent, je vais vous montrer comment vous y rendre.",
    "flavor_es": "Dicen que monstruos de la antig\u00fcedad campan a sus anchas por alg\u00fan lugar. Siempre quise saber d\u00f3nde. Arriesgu\u00e9 mi vida para encontrarlo, y ahora te ense\u00f1ar\u00e9 c\u00f3mo ir.",
    "flavor_it": "Si racconta che da qualche parte vaghino ancora mostri dell'antichit\u00e0. Ho rischiato la vita per trovare questo luogo. Ora, per tua somma gioia, posso mostrarti come arrivarci!",
