    "flavor_fr": "J'ai vu un Gypceros qui \u00e9mettait une \u00e9trange lueur. \u00c7a m'a donn\u00e9 envie de lui casser la figure. J'ai utilis\u00e9 mes arts de chasse, mais il s'est enfui. Au moins, je me suis amus\u00e9. Allez l'achever !",
