    "flavor_de": "Schon mal niedergeschlagen worden? Ich kenne ein Monster, das echt hart zuschl\u00e4gt. Von seinem klebrigen Schleim ganz zu schweigen; gut, dass der ab war, bevor ich zu Boden ging. Bereit f\u00fcr eine Runde?",
