    "flavor_es": "\u00bfQuieres que te noqueen? S\u00e9 de un monstruo que tiene un buen gancho. Y esos mocos pegajosos... Al menos me los quit\u00e9 de encima antes de que acabara la cuenta. \u00bfTe animas?",
    "flavor_it": "Ti hanno mai spedito al tappeto? Conosco un mostro che sferra colpi potentissimi. Per non parlare di quella sostanza appiccicosa. Fortuna che si \u00e8 tolta prima della fine del conteggio.",
