    "flavor": "I ran into a Tigrex in the Frontier, and then a Zinogre jumped out, too! Just when I thought I was done for, the Tigrex charged the Zinogre, and I made a break for it! I can't take much more of this!",
    "flavor_de": "Mir ist im Jura-Grenzland ein Tigrex begegnet, und dann erschien auch noch ein Zinogre! Als der Tigrex den Zinogre angegriffen hat, bin ich gerannt! Lange halt ich das aber nicht mehr aus!",
    "flavor_fr": "J'ai crois\u00e9 un Tigrex \u00e0 la Fronti\u00e8re jurassique et l\u00e0, un Zinogre a surgi de nulle part ! J'ai bien cru y passer, mais le Tigrex a fonc\u00e9 sur le Zinogre. J'ai pris mes jambes \u00e0 mon cou ! Trop c'est trop !",
    "flavor_es": "Me cruc\u00e9 con un Tigrex en la Fronda Arcaica y tambi\u00e9n vi un Zinogre. Cuando ya lo daba todo por perdido, el Tigrex embisti\u00f3 al Zinogre y sal\u00ed corriendo. Esto no puede seguir as\u00ed.",
    "flavor_it": "Nella frontiera giurassica mi sono imbattuto in un Tigrex e in uno Zinogre! Pensavo d'essere spacciato, ma il Tigrex ha caricato lo Zinogre e sono fuggito! Non ne posso pi\u00f9 di questa vita!",
