    "flavor": "If I'm gonna follow this plan to a T, I'm going to need all the materials I can get! And I can't get them with a bunch of Rajang hanging on my back. That's where you come in!",
    "flavor_de": "Wenn ich diesen Plan in die Tat umsetzen will, brauche ich m\u00f6glichst viel Material! Und das kriege ich nicht, solange diese Rajang hinter mir her sind. Und da kommst du ins Spiel!",
