    "flavor": "\"Nobody can handle a Rajang and a Deviljho,\" they said. \"Impossible,\" they said. So I made an impulse bet with my life savings. Now I have gambler's remorse. Mind evening the odds for me?",
    "flavor_de": "Jeder hat gesagt: \"Niemand kann es mit einem Rajang und einem D\u00e4monjho aufnehmen.\" \"Unm\u00f6glich.\" Also habe ich spontan alle meine Ersparnisse gewettet. Jetzt bereue ich es. Gleichst du das f\u00fcr mich aus?",
