    "flavor_fr": "Je re\u00e7ois des d\u00e9charges d\u00e8s que je me d\u00e9place. Maman dit que c'est \u00e0 cause des monstres de foudre du coin. Je ne sais pas si c'est vrai, mais \u00e7a fait mal ! Vous pourriez m'aider ?",
