    "flavor_it": "Quando cammino prendo sempre la scossa! Mia madre dice che \u00e8 per via dei numerosi mostri del tuono che si aggirano qui intorno. Quel che \u00e8 certo, \u00e8 che mi fa malissimo! Mi aiuteresti?",
