    "flavor_de": "Ein... bestimmter... Jemand m\u00f6chte, dass du diese strengvertrauliche Quest absolvierst. Selbst ich wei\u00df nicht warum. Aber dein Ziel ist ein Ferus-Tigrex... Pass auf dich auf!",
