    "flavor_es": "Cierta persona... necesita que hagas esta misi\u00f3n de alta importancia. Ni siquiera yo s\u00e9 bien por qu\u00e9. Tu objetivo: un H\u00edper Tigrex. Creo que no hace falta decirlo, pero ve con cuidado.",
    "flavor_it": "Ho una missione segreta per te. Sono ordini dall'alto, per cui nemmeno io conosco i dettagli. Il tuo obiettivo: un Tigrex iper. Bah! Quelli normali non erano abbastanza molesti? Occhi aperti, eh!",
