    "flavor": "Help! A Hyper Rathalos is in the Volcanic Hollow! I told the Kokoto Gal that if we didn't act now, we'd all be done for, but she just laughed! I can't be the only one who thinks we're in big trouble!",
    "flavor_de": "Hilfe! In der Vulkanmulde ist ein Ferus-Rathalos! Ich hab zu dem Kokoto-M\u00e4del gesagt, wir m\u00fcssen was unternehmen, aber sie hat nur gelacht. Erkennt denn sonst niemand die Gefahr?",
    "flavor_fr": "\u00c0 l'aide ! Un hyper Rathalos est au Vallon volcanique ! J'ai dit \u00e0 la Demoiselle Kokoto que si nous ne faisons rien, nous sommes perdus ! Et elle m'a ri au nez ! Elle ne voit donc pas le danger ?",
    "flavor_es": "\u00a1Ayuda! Hay un H\u00edper Rathalos en el Hoyo Volc\u00e1n. Le dije a la chica de Kokoto que si no actuamos ahora, estamos perdidos, pero se rio. No soy el \u00fanico que lo piensa, \u00bfverdad?",
