    "flavor_fr": "Je dois chasser une Reine Seltas, mais je ne me sens pas \u00e0 la hauteur. Celle-ci n'est pas comme les autres. Je dois m'entra\u00eener davantage. Pourriez-vous vous en charger \u00e0 ma place ?",
