    "flavor_fr": "Elle \u00e9tait si chaude que l'air semblait hurler de douleur. C'\u00e9tait une \u00e9p\u00e9e hors du commun, forg\u00e9e pour le combat. Je crains qu'elle ne brise ma fid\u00e8le lame. Prenez le relais.",
