    "flavor": "That intimidating crest and its sharp gaze cutting through that menacing dark glow... These things are terrifying! What could they be planning? No! I-It can't be! It's coming toward us! P-Please, help!",
    "flavor_de": "Dieser furchterregende Kamm und der stechende Blick, der das finstere Gl\u00fchen durch- dringt \u2013 einfach entsetzlich! Was sie wohl vorhaben? Oh, nein! Das Ding kommt auf uns zu! H-Hilf uns, bitte!",
    "flavor_fr": "Cette cr\u00eate intimidante, ce regard per\u00e7ant et cette lueur mena\u00e7ante... Ces b\u00eates sont terrifiantes ! Que mijotent-elles ? Non ! Impossible ! Elle se dirige vers nous ! \u00c0 l'aide !",
