    "flavor_es": "Hacemos catas en el suelo en busca de sitios aptos para crear ba\u00f1os termales. He encontrado el lugar perfecto. Solo falta librarse de los H\u00edper monstruos que rondan por all\u00ed.",
    "flavor_it": "Noi cerchiamo sempre suoli adatti per nuove terme. E credo proprio d'aver trovato un luogo prrrfetto! Mi serve solo che tu sgombri la zona dai miaostri iper che la infestano!",
