    "flavor_de": "*seufz* Ein K\u00f6nig hat es schon schwer. Eine Ratsversammlung folgt der anderen. Ich w\u00fcrde gerne das goldene Monstrum sehen, das mein Barde besungen hat. Bring es zu mir, J\u00e4ger!",
