    "flavor_es": "*Suspiro* Es dif\u00edcil ser rey. En mi vida solo hay consejo tras consejo. Ans\u00edo ver los mitos que canta mi juglar, como el wyvern dorado del que tanto he o\u00eddo hablar. \u00a1B\u00fascalo, cazador!",
    "flavor_it": "*Sigh* Non \u00e8 piacevole essere re. La vita \u00e8 solo un susseguirsi di riunioni. Mi piacerebbe vedere le creature descritte nelle ballate del mio amato menestrello, come il wyvern dorato di cui ho sentito tanto parlare...",
    "flavor_ja": "",
