    "flavor_de": "Endlich hat der Rajang sein wahres Gesicht gezeigt. Er w\u00fcrde schlimmste Zerst\u00f6rung \u00fcber uns bringen. Ich muss ihn dir \u00fcberlassen, da auf mich eine andere Aufgabe und meine Liebsten warten.",
    "flavor_fr": "Le Rajang montre enfin sa vraie nature. Si on le laisse faire, il d\u00e9truira tout. Vous allez devoir l'\u00e9liminer. J'ai une autre mission \u00e0 accomplir et mes proches attendent mon retour.",
