    "flavor": "The moon is especially beautiful here. Nature is at its best when untouched by mankind... However, you must beware, as this very nature may visit its wrath upon the unsuspecting.",
    "flavor_de": "Der Mond ist hier besonders sch\u00f6n. Die vom Menschen unber\u00fchrte Natur ist makellos... Aber h\u00fcte dich, denn diese Natur kann den Ahnungslosen mit ihrem Zorn heimsuchen.",
    "flavor_fr": "La lune est si belle ici. La nature est d'autant plus magnifique lorsqu'elle n'a pas \u00e9t\u00e9 souill\u00e9e par l'homme. Attention toutefois, cette m\u00eame nature peut lib\u00e9rer son courroux quand on s'y attend le moins.",
    "flavor_es": "La luna es especialmente hermosa aqu\u00ed. La naturaleza est\u00e1 mejor lejos del hombre. No obstante, hay que tener cuidado, ya que su ira puede caer sobre los que se conf\u00edan en exceso.",
    "flavor_it": "La luna qui \u00e8 stupenda... La natura offre il meglio di s\u00e9 quando l'uomo non ci mette le mani. Ma sii sempre vigile, perch\u00e9 la natura pu\u00f2 anche scatenare la sua furia sugli ingenui.",
