    "flavor_fr": "Il existe un monstre que m\u00eame les membres de la Guilde de Loc Lac craignent. Le Deviljho ! Vous \u00eates peut-\u00eatre le seul Chasseur de taille \u00e0 l'affronter ! \u00c9liminez cette inf\u00e2me b\u00eate !",
