    "flavor_de": "Ich habe sie gesehen. Ganz sicher. Zwei schwarze Fl\u00fcgel im Schneegest\u00f6ber... Dann wurde ich fast vom Berg geweht. H\u00f6r auf meinen Rat und n\u00e4here dich diesem Ding erst gar nicht!",
