    "flavor_fr": "Les blizzards sont de plus en plus fr\u00e9quents. Il s'av\u00e8re qu'un Kushala Daora en est la cause. Des temp\u00eates d\u00e9vastatrices menacent de nous exterminer. Chasseur, vous devez nous aider !",
