    "flavor": "When I was a child, a Teostra attacked our village. Now, that foul beast has come again to rain destruction down upon us. Please! Put an end to this evil presence!",
    "flavor_de": "Als ich ein Kind war, griff ein Teostra unser Dorf an. Jetzt ist diese \u00fcble Bestie zur\u00fcckgekehrt, um Zerst\u00f6- rung \u00fcber uns zu bringen. Bitte setze dieser b\u00f6sen Existenz ein Ende!",
    "flavor_fr": "Quand j'\u00e9tais enfant, un Teostra a attaqu\u00e9 mon village. Aujourd'hui, cet horrible monstre a refait surface pour semer \u00e0 nouveau le chaos. Par piti\u00e9, emp\u00eachez-le de nuire !",
    "flavor_es": "Cuando yo era peque\u00f1o, un Teostra atac\u00f3 la aldea. Esa bestia inmunda ha regresado para sumirnos en el caos. Por favor, acaba con su mal\u00e9vola presencia.",
    "flavor_it": "Quand'ero piccolo, un Teostra ha attaccato il nostro villaggio. Ora la bestiaccia \u00e8 tornata, e so che per noi sar\u00e0 la fine. Ti supplico! Liberaci da questa presenza malefica!",
