    "flavor": "Uh-oh. Our observers over at the Volcano have gone silent. Their last message mentioned something about a \"black god.\" That can't be good. We need someone to investigate.",
    "flavor_de": "Oh nein! Unsere Beobachter am Vulkan sind verstummt. In ihrer letzten Nachricht erw\u00e4hnten sie einen \"schwarzen Gott\". Das kann nichts Gutes bedeuten. Da muss jemand nachforschen!",
    "flavor_fr": "Nos \u00e9claireurs au Volcan ne nous donnent plus signe de vie. Leur dernier message faisait \u00e9tat d'une \"d\u00e9it\u00e9 obscure\". Cela n'augure rien de bon. Il faut que quelqu'un m\u00e8ne l'enqu\u00eate.",
    "flavor_es": "Oh, no. Hemos perdido el contacto con los oteadores que enviamos al Volc\u00e1n. Su \u00faltimo mensaje mencionaba un \"dios negro\". No puede ser nada bueno. Alguien tiene que investigar.",
    "flavor_it": "Oh oh. I nostri osservatori sul vulcano sono spariti. Il loro ultimo messaggio parlava di un \"dio nero\". Non promette nulla di buono. Bisogna che qualcuno vada a dare un'occhiata.",
