    "flavor": "An Ukanlos appeared in the Polar Field and is headed towards this village. But we've got one hope, and that's you. Everyone here believes in you. Please, save our village!",
    "flavor_de": "Ein Ukanlos ist im Polarfeld aufgetaucht und bewegt sich auf dieses Dorf zu. Doch auch du bist hier- her gekommen. Das muss ein Zeichen sein. Alle glauben an dich. Bitte rette uns!",
    "flavor_fr": "Un Ukanlos est apparu dans la Zone polaire et se dirige vers notre village. Mais vous voil\u00e0 aussi parmi nous, ce doit \u00eatre un signe. Nous nous en remettons \u00e0 vous. Piti\u00e9, sauvez-nous !",
    "flavor_es": "Ha aparecido un Ukanlos en la Zona Polar y se dirige hacia esta aldea. Pero tambi\u00e9n has venido t\u00fa. Debe de ser una especie de se\u00f1al. Todo el mundo cree en ti. Por favor, s\u00e1lvanos.",
