    "flavor": "We have met many times, and you have never failed to impress me with your courage in the face of adversity. Now, with Amatsu threatening our village, we need your bravery more than ever.",
    "flavor_de": "Wir sind uns oft begegnet und du hast mich immer mit deinem Mut in der Not beeindruckt. Jetzt, da Amatsu unser Dorf bedrohen, brauchen wir deine Tapferkeit mehr denn je.",
    "flavor_fr": "Vous avez r\u00e9ussi \u00e0 m'\u00e9pater \u00e0 chaque fois, quel courage face \u00e0 l'adversit\u00e9 ! Un Amatsu menace notre village en ce moment et votre bravoure nous est plus n\u00e9cessaire que jamais.",
    "flavor_es": "Nos hemos visto varias veces y en todas me ha impresionado tu valor frente a la adversidad. Ahora que un Amatsu amenaza la aldea, necesitamos tu valor m\u00e1s que nunca.",
