    "sub_goal_ja": "",
    "flavor": "\"None can foresee disaster. In darkness, it comes; among despair, it departs. Now is such a time, when all may struggle...and in the end, perish.\" Catchy, eh? My aide wrote it. Anyway, save us!",
    "flavor_de": "\"Keiner kann Ungl\u00fcck vorher- sehen. Es kommt im Dunkeln und hinterl\u00e4sst Verzweiflung. In dieser Zeit kann unsere Rasse sich behaupten oder unter- gehen.\" Gut, oder? Hat mein Redenschreiber verfasst!",
    "flavor_fr": "\"Un d\u00e9sastre est impr\u00e9visible. Il vient des t\u00e9n\u00e8bres, semant le d\u00e9sespoir sur son passage. Arrive le moment o\u00f9 une race ne peut que se battre ou p\u00e9rir.\" Accrocheur, non ? Ma plume l'a \u00e9crit. Sauvez-nous !",
    "flavor_es": "\"Nadie puede prever el desastre. Llega de noche y amanece con desesperaci\u00f3n. Ha llegado el momento en el que podemos luchar o morir\". Suena bien, \u00bfverdad? Me lo han escrito. \u00a1Va, s\u00e1lvanos!",
    "flavor_it": "Un disastro non si prevede. Sbuca all'improvviso e non resta che lottare o perire!. Bello, eh? L'ha scritto il mio autore di discorsi, ma il succo \u00e8 semplice: salvaci!",
