    "flavor": "It's dinnertime, and the tab is on you. And I'm feeling in the mood for some barbecue! Hunt a Larinoth for its Raw Meat, and then whip me up a Well-done Steak! Mm-mm, I can't wait!",
    "flavor_de": "Heute bist du f\u00fcr das Abend- essen zust\u00e4ndig. Ich hab Lust auf Gegrilltes. Erlege einen Larinoth, um Rohes Fleisch zu besorgen, dann grill uns daraus ein Gebratenes Steak! Und beeil dich, ich hab Hunger!",
    "flavor_fr": "Il est temps de manger et c'est \u00e0 vous de faire la cuisine. Et j'ai envie d'un barbecue ! Traquez donc un Larinoth pour sa viande et pr\u00e9parez-moi un steak en vitesse ! Miam, j'ai faim !",
    "flavor_es": "Es hora de la cena y te toca a ti servirla. Me apetece una buena barbacoa. Caza a un Larinoth por la carne cruda, y hazme un filete al punto. \u00a1Mm, qu\u00e9 hambre!",
    "flavor_it": "\u00c8 ora di cena, e ho proprio voglia di barbecue! Caccia un Larinoth e prendine la carne cruda, quindi preparami una bistecca ben cotta. Mmm, ho gi\u00e0 l'acquolina in bocca!",
