    "flavor": "Hey, Hunter! Do you know how to transport Carnivore Eggs without breaking them? You will after this! Remember, they're delicate, so take out any Maccaos before snatching any eggs!",
    "flavor_de": "Hey, J\u00e4ger! Wei\u00dft du, wie du Fleischfresser-Eier transportierst, ohne sie zu zerbrechen? Erlege am besten erst alle Maccaos, ehe du mit diesen delikaten Delikatessen aufbrichst!",
