    "flavor": "Today's a big day: you're off to slay a Great Maccao! Failure is literally not an option -- at least, not if you're accustomed to having all your body parts! Now, show me you've got what it takes to be a hunter!",
    "flavor_de": "Heute ist ein gro\u00dfer Tag f\u00fcr dich! Du sollst einen Gro\u00df-Maccao erlegen. Jetzt kannst du zeigen, dass du ein wahrer J\u00e4ger bist \u2013 musst du sogar, wenn du da heil wieder rauskommen willst!",
    "flavor_fr": "Aujourd'hui est un grand jour : sus au Grand Maccao ! Vous n'avez pas le droit d'\u00e9chouer... du moins, pas si vous voulez revenir en un seul morceau ! Montrez-moi de quoi vous \u00eates capable !",
    "flavor_es": "Hoy es un gran d\u00eda: \u00a1vas a acabar con un Gran Maccao! No puedes fallar... o te sentir\u00e1s un poco incompleto, literalmente. \u00a1Demu\u00e9strame qu\u00e9 significa ser un cazador!",
