    "flavor": "Ah, a Prowler! You came at the right time! Would you be willing to collect me some points in the Jurassic Frontier? Deliver whatever items you like. Oughta be a breeze for you, eh?",
    "flavor_de": "Ah, ein Pirscher! Genau zur richtigen Zeit! W\u00fcrdest du f\u00fcr mich im Jura-Grenzland ein paar Punkte sammeln? Liefere als Objekte ab, was du willst. Das ist doch ein Kinderspiel f\u00fcr dich, oder?",
    "flavor_fr": "Un Miaroudeur ! Vous tombez \u00e0 pic ! Accepteriez-vous de r\u00e9cup\u00e9rer des points pour mon compte \u00e0 la Fronti\u00e8re jurassique ? Livrez les objets de votre choix. \u00c7a n'a rien de bien compliqu\u00e9.",
    "flavor_es": "\u00a1Un gatador! \u00a1Llegas justo a tiempo! \u00bfQuieres obtener puntos para m\u00ed en la Fronda Arcaica? Entrega lo que quieras. Seguro que te resulta sencillo.",
    "flavor_it": "Ah, cacciamiao! Capiti proprio a fagiolo! Avresti voglia di raccogliere dei punticini alla frontiera giurassica? Consegna pure gli oggetti che vuoi. Per te sar\u00e0 una passeggiata, no?",
