    "flavor": "I refuse to stand by and see my precious Felynes bullied! Oh, I'm talking about those cursed Melynx running amok. If you can help me out, I'll teach you how to easily employ more Felynes!",
    "flavor_de": "Ich sehe nicht zu, wie mei- ne lieben Felynen tyranni- siert werden. Ich spreche von den verdammten Melynxe. Wenn du mir hilfst, zeige ich dir, wie du problemlos mehr Felynen engagierst!",
    "flavor_fr": "Je ne resterai pas les bras crois\u00e9s sans rien faire alors que ces maudits Melynx pers\u00e9cutent mes Felynes. Aidez-moi et je vous aiderai \u00e0 recruter ais\u00e9ment d'autres Felynes !",
    "flavor_es": "\u00a1No voy a dejar que abusen de mis queridos Felyne! Me refiero a esos malditos Melynx que andan desbocados. Si me ayudas, te ense\u00f1ar\u00e9 a contratar f\u00e1cilmente m\u00e1s Felyne.",
    "flavor_it": "Non posso stare a guardare mentre fanno i prepotenti con i miei preziosi Felyne! Oh, parlo di quei maledetti Melynx impazziti. Mi aiuti? Ti dir\u00f2 come ingaggiare facilmente altri Felyne!",
