    "flavor": "Ah, my good Prowler friend! I've had nothing but good luck since our last little encounter. Now, I need you to collect points in the Verdant Hills. Deliver any items you like. Oughta be a breeze for you!",
    "flavor_de": "Ah, Pirscher, mein Freund! Seit unserem Treffen hatte ich nur Gl\u00fcck. Sammle jetzt in den Gr\u00fcnen H\u00fcgeln Punkte. Liefere als Objekte ab, was du willst. Das ist doch ein Kinderspiel f\u00fcr dich!",
    "flavor_fr": "La chance me sourit depuis la derni\u00e8re fois, Miaroudeur. Il faut maintenant que vous r\u00e9cup\u00e9riez des points dans les Collines verdoyantes. Livrez ce que vous voulez. C'est un jeu d'enfant !",
    "flavor_es": "\u00a1Mi buen gatador! He tenido buena suerte desde que nos vimos. Necesito obtener puntos en el Bosque Rocoso. Entrega lo que quieras. Te ser\u00e1 sencillo, ya ver\u00e1s.",
    "flavor_it": "Ah, cacciamiao! La fortuna non smette di sorridermi, da quando ci siamo incontrati! Ora, voglio che tu raccolga punti sui colli verdi. Consegna gli oggetti che vuoi. Sar\u00e0 una passeggiata!",
