    "flavor": "Girl, this Balmstone Piece smells something FIERCE. If I had more, I could carry them around as perfume and REALLY work it! Get some for me, would you? Good luck, and DON'T screw it up!",
    "flavor_de": "Oh Mann, dieses Balsamstein- St\u00fcck riecht INTENSIV! Wenn ich mehr davon h\u00e4tte, k\u00f6nnte ich das Zeug als eine Art Parfum nutzen. Das w\u00e4re echt DUFTE! Besorge mir noch ein paar davon, ja?",
    "flavor_fr": "Ah... Quelle odeur divine ! Un morceau d'odoripierre ! J'aimerais r\u00e9aliser un collier. Mais il m'en faut plus ! Vous pourriez m'aider ? Quoi ? Une hache ? Les Miaroudeurs n'en ont pas besoin, enfin !",
    "flavor_es": "\u00a1Ah! \u00a1Qu\u00e9 olor m\u00e1s divino! Se le llama pieza \u00f3nix. La consegu\u00ed en los Picos Nublados, pero ahora necesito m\u00e1s. Me har\u00e1s ese favor, \u00bfno? \u00bfUn pico? Eres un gatador, no lo necesitas.",
    "flavor_it": "Ah... Questo profumo \u00e8 cos\u00ec divino! Proviene da un pezzo di balsamite! Ne ho trovato uno sulle cime nebbiose, ma ne voglio di pi\u00f9! Ci pensi tu, vero? Eh? Un piccone? Ma per farci cosa, cacciamiao?",
