    "flavor": "We Felynes love fishing, but we need to purrform more studies if we want to discover the secrets of fishing and share them with the world! Those big pink Premium Sashimi should be purrfect for our research!",
    "flavor_de": "Wir Felynen lieben das Fi- schen, aber dessen Geheim- nissen kommen wir nur mit mehr Forschung und Publika- tionen auf die Spur. Diese gro\u00dfen rosa Premium-Sashimi sind daf\u00fcr miausgezeichnet!",
    "flavor_fr": "Les Felynes aiment la p\u00eache, mais il faut approfondir nos recherches en la mati\u00e8re pour partager nos secrets avec le reste du monde ! Ces gros sashimis Premium roses seraient parfaits !",
    "flavor_es": "A los Felyne nos encanta pescar, pero tenemos que estudiar para descubrir los secretos de la pesca y compartirlos. Esos sashimi especiales rosas ser\u00edan perfectos para el estudio.",
