    "flavor": "Okay, just a little off the...ack! Cutting Moofah fur is like trying to trim a hairball! Do me a solid and show me how you deal with it! ...You DO have a Cutting weapon, don't you? Every good fur stylist needs one!",
    "flavor_de": "Okay, das war ein wenig... ups! Muufah-Fell schneiden ist wie ein Haarkn\u00e4uel frisieren. Tu mir den Gefallen, zeig es mir... Eine Schnittwaffe hast du!? Ein Muss f\u00fcr Fellstylisten!",
    "flavor_fr": "On coupe un peu sur... Oh, cette toison de Moofah est un vrai cauchemar ! Vous pourriez me montrer comment faire ? Vous avez une arme tranchante ? Un bon styliste ne sort jamais sans !",
    "flavor_es": "Un peque\u00f1o corte... \u00a1Grrr! Cortar pelo de Moofah es como intentar peinar una pelusa. \u00a1Anda, ens\u00e9\u00f1ame c\u00f3mo se hace! Tienes algo que corte, \u00bfno? Todo buen estilista lo necesita.",
