    "flavor": "Saikin, lately, Marshlands filled with giant insects. Ruining seinokei, ecosystem of Moga Village! Get rid of bugs, they ask. Come with Neko to turn the mushi into mush! \"Mushi\" means bug!",
    "flavor_de": "Saikin, das hei\u00dft unl\u00e4ngst, ist das Marschland voller Rieseninsekten. Sie zerst\u00f6ren Seinokei, das \u00d6kosystem des Dorfes Moga. Werde mit Neko die Mushi-Plage los. Mushi hei\u00dft \"K\u00e4fer\"!",
    "flavor_fr": "En ce moment, les Marais grouillent d'insectes g\u00e9ants. Ils ruinent l'\u00e9cosyst\u00e8me du Village Moga ! Aidez-moi \u00e0 tuer les mushi ! Mushi veut dire insecte.",
    "flavor_es": "Saikin, \u00faltimamente, la Ci\u00e9naga rebosa bichos gigantes que destrozan el ecosistema de Moga. Quieren deshacerse de ellos. Hagamos el encargo m\u00e1s mushi (significa bicho).",
    "flavor_it": "Saikin, di recente, palude \u00e8 piena di mushi giganti. \"Mushi\" significa insetti! Cos\u00ec rovinano ecosistema di Villaggio di Moga! Manda via insetti, chiedono. Vieni con Neko a scacciare mushi!",
