    "flavor": "Hey, how about a friendly little competition? Let's see if either of us can wound the head of one of those gaudy Great Maccao! If you succeed, then I'll teach you how to hire more Palicoes!",
    "flavor_de": "Hey, was h\u00e4ltst du von einem kleinen Wettstreit? Ob wohl einer von uns den Kopf eines bunten Gro\u00df-Maccao verletzen kann? Wenn du gewinnst, gibt's mehr Tipps zum Anheuern von Kameraden!",
    "flavor_fr": "Un petit concours amical, \u00e7a vous dit ? Voyons si un d'entre nous peut briser la t\u00eate d'un Grand Maccao ! Si vous y parvenez, je vous expliquerai comment engager d'autres Palicos !",
    "flavor_es": "\u00bfOs apetece una competici\u00f3n amistosa? A ver si pod\u00e9is herir las cabezas de esos Gran Maccao fanfarrones. Si lo logr\u00e1is, os ense\u00f1ar\u00e9 a contratar m\u00e1s camaradas.",
    "flavor_it": "Ehil\u00e0! Ti va una piccola sfida? Vediamo se uno di noi riesce a ferire la testa di uno di quei Gran Maccao dai colori sgargianti! Se vinci, ti insegner\u00f2 come ingaggiare altri compagni!",
