    "flavor": "No matter how many times a Bullfango charges me, I can never evade it. And I'm not lion, I'm trying real hard! I just turn around, and run straight! What am I doing wrong!?",
    "flavor_de": "Wie oft auch ein Bullfango mich angreift, ich entgehe ihm nie. Das ist nicht an den Schnurrhaaren herbeige- zogen. Umdrehen, weglaufen, was mache ich falsch?!",
    "flavor_fr": "J'ai beau essayer, chaque fois qu'un Bullfango charge sur moi, je n'arrive pas \u00e0 l'\u00e9viter. Pourtant, je fais de mon mieux ! Je fais volte-face et je cours tout droit. Je m'y prends mal ?",
    "flavor_es": "Da igual cu\u00e1ntas veces me embista un Bullfango, nunca consigo esquivarlo. Y no ser\u00e1 porque no lo intento, de veras. Me doy la vuelta y corro en l\u00ednea recta. \u00bfQu\u00e9 es lo que hago mal?",
    "flavor_it": "Oh, i Bullfango mi caricano sempre, ma non c'\u00e8 una volta che mi riesca di schivarli. Non sar\u00f2 un leone, eppure mi impegno! Mi giro e scappo tutta a dritta! Dov'\u00e8 che sbaglio?!",
