    "flavor": "Hey, Prowler. You'll help a kit in need, right? I need a Gargwa Egg. Why? 'Claws I said so! Less talkin', more egg-straction! Here's a tip: poke it from behind, and maybe it'll leave an egg for ya. I'm countin' on you!",
    "flavor_de": "Hey, Pirscher. Du hilfst doch einer Katze in Not?! Ich brauche ein Gargwa-Ei. Warum? Kann dir ganz Ei-gal sein. Ein Tipp: Ein Sto\u00df von hinten sichert dir mit Gl\u00fcck ein Ei. Also los!",
    "flavor_fr": "Aidez un matou en d\u00e9tresse. Il me faut un \u0153uf de Gargwa. Pourquoi ? M\u00ealez-vous de vos chatons. Un conseil : piquez-le par-derri\u00e8re. Qui sait, il pondra peut-\u00eatre un \u0153uf. Je compte sur vous !",
    "flavor_es": "\u00a1Eh, gatador! \u00bfMe ayudas? Necesito un huevo de Gargwa. \u00bfQue por qu\u00e9? \u00a1Porque s\u00ed! Venga, d\u00e9jate de rollos. Si le golpeas por detr\u00e1s, tal vez suelte un huevo. Cuento contigo.",
    "flavor_it": "Ehi, cacciamiao. I mici si vedono nel miaomento del bisogno, s\u00ec? Ebbene, a me serve un uovo di Gargwa! Perch\u00e9? Perch\u00e9 l'uovoglio! Ricorda: colpendo da dietro, magari ti sgancia un ovetto!",
