    "flavor_fr": "Le secret de la cuisine, c'est de faire au plus vite et de tout cuire \u00e0 feu vif ! Il suffit ensuite d'ajouter mon ingr\u00e9dient secret et... Quoi ? Je n'en ai plus ? Vous pourriez en chercher ?",
    "flavor_es": "El secreto de la cocina es tardar lo menos posible y cocinar con fuego alto. Solo hay que a\u00f1adir mi ingrediente secreto y... \u00bf\u00a1Qu\u00e9!? \u00a1Se me ha acabado! Cons\u00edgueme m\u00e1s, por favor.",
    "flavor_it": "Il miao segreto in cucina? Spreco meno tempo possibile e cuocio tutto a fiamma alta! Poi aggiungo un pizzico del mio ingrediente segreto e... Miah! \u00c8 finito?! Ti prrrego, portamene ancora!",
