    "flavor_de": "Der Tanzia-Markt bietet frischste Sakana. Sakana hei\u00dft \"Fische\". Shikashi! Aber! Finde du gute Angel- pl\u00e4tze, wir sichere Versor- gung. F\u00fcr mehr oishi Fisch! Oishi hei\u00dft \"lecker\".",
