    "flavor_es": "El mercado de Tanzia tiene el sakana (pescado) m\u00e1s fresco. \u00a1Shikashi! Pero si encuentras buenas zonas de pesca, nos aseguramos el suministro. El pescado rico mejorar\u00e1 las ventas.",
