    "flavor": "Prowler, heed my request! There's an Iodrome in the Marshlands I've been hunting, but a gang of Ioprey keep getting in the way! Do you think you could lend me a hand out there?",
    "flavor_de": "Pirscher, h\u00f6r mir zu! Ich habe im Marschland einen Iodrome gejagt, aber eine Gruppe Ioprey ist mir immerzu im Weg! Kannst du mir vielleicht helfen da drau\u00dfen?",
    "flavor_fr": "Miaroudeur, j'ai besoin de vous ! Je chasse un Iodrome dans les marais, mais une bande d'Ioprey me met des b\u00e2tons dans les roues ! Vous pourriez me donner un petit coup de main ?",
    "flavor_es": "\u00a1Escucha mi petici\u00f3n, gatador! Estoy intentando cazar un Iodrome en la Ci\u00e9naga, pero una banda de Ioprey se interpone en mi camino. \u00bfPodr\u00edas echarme una mano?",
