    "flavor": "Hey, Prowler! You'll help a kit in need, right? I need a Wyvern Egg! Little dangerous, but that's purr for the course for you, nya? That egg should be nutritious enough to... Uh, nevermind! Just get that egg!",
    "flavor_de": "Hey, Pirscher! Du hilfst doch einer Katze in Not?! Ich brauche ein Wyvern-Ei! Das ist nat\u00fcrlich nicht ungef\u00e4hrlich. Das Ei ist so nahrhaft... Ach, vergiss es! Hol einfach das Ei!",
    "flavor_fr": "Vous aideriez un matou en d\u00e9tresse ? Il me faut un \u0153uf de wyverne ! C'est difficile, mais vous retomberez sur vos pattes ! Cet \u0153uf sera assez gros pour... Oubliez ! Apportez-le moi !",
    "flavor_es": "\u00a1Eh, gatador! \u00bfAyudar\u00edas a un minino necesitado? Necesito un huevo de wyvern. Tiene cierto peligro, pero eso no te para, \u00bfno? Es nutritivo y... Da igual. Anda, tr\u00e1emelo.",
    "flavor_it": "Ehi, cacciamiao! I veri mici si vedono nel miaomento del bisogno, s\u00ec? Ecco, a me serve un uovo di wyvern! Ok, \u00e8 rischioso, ma sai quanto \u00e8 gustoso? E nutriente! E... Insomma, prendi quell'uovo!",
