    "flavor": "I was playing hide-and-seek at the Volcano when Uroktor burst from the ground -- talk about a surpurrise! Luckily, I burrowed before they could see me. If you run into trouble, be sure to hide as soon as possible!",
    "flavor_de": "Ich hab am Vulkan Verstecken gespielt, da kommt ein Uroktor aus dem Boden geschossen und l\u00e4sst mir die Schnurrhaare zu Berge stehen! Zum Gl\u00fcck hat er mich nicht gesehen. Bei \u00c4rger versteck dich blo\u00df sofort!",
    "flavor_fr": "Je jouais \u00e0 cache-cache au Volcan quand un Uroktor a surgi du sol. Heureusement, j'ai r\u00e9ussi \u00e0 m'enfouir avant qu'il ne me voie. En cas de probl\u00e8me, cachez-vous rapidement !",
    "flavor_es": "Estaba jugando al escondite en Volc\u00e1n cuando ha salido un Uroktor de un matorral. \u00a1Menuda sorpresa! Por suerte, me he enterrado y no me ha visto. Si te ves en apuros, esc\u00f3ndete r\u00e1pido.",
