    "flavor": "Ugh... I took this job, but I'm having a little trouble finishing it. Help me out? Remobras hate loud noises, so use that to your advantage. Also... They're ravenous carnivores. Good luck!",
    "flavor_de": "Pfui Teufel... Ich habe diesen Job \u00fcbernommen, aber er macht mir Probleme. Hilfst du mir? Remobras hassen L\u00e4rm, also nutz das aus. Sie sind auch gierige Fleischfresser. Viel Gl\u00fcck!",
    "flavor_fr": "Pff, j'ai accept\u00e9 une t\u00e2che, mais je ne m'en sors pas. Vous pourriez m'aider ? Les Remobra d\u00e9testent le bruit, alors, faites du boucan. Au fait, ces carnivores sont affam\u00e9s. Bonne chance !",
    "flavor_es": "Uf, acept\u00e9 un encargo, pero me est\u00e1 costando acabarlo. \u00bfMe ayudas? Usa el hecho de que los Remobra odian el ruido. Y tambi\u00e9n que son carn\u00edvoros voraces. \u00a1Buena suerte!",
