    "flavor": "Was delivering new trade cart when spotted by Yian Kut-Ku! Prowler, find dishonorable beast and attack its big mimi! \"Mimi\" means ears! Then Neko can finally deliver new cart to help with trade! Yakusoku!",
    "flavor_de": "Ich liefere neuen Handels- karren aus, da sieht mich Yian Kut-Ku. Pirscher, such ehrlose Bestie und geh ihre gro\u00dfen Mimi an! Mimi hei\u00dft \"Ohren\". Dann kann Neko endlich liefern! Yakusoku!",
    "flavor_fr": "Un Yian Kut-Ku m'a rep\u00e9r\u00e9 lors d'une livraison ! Miaroudeur, chassez-le co\u00fbte que co\u00fbte pour que je puisse reprendre mes affaires ! Attaquez ses grandes oreilles !",
    "flavor_es": "Iba a entregar un carro de mercanc\u00edas cuando me ha visto un Yian Kut-Ku. Busca a esa bestia y ataca en sus mimi (significa orejas). Neko entregar\u00e1 el carro de hacer negocios. \u00a1Yakusoku!",
    "flavor_it": "Neko consegnava carro quando avvistato da Yian Kut-Ku! Tu trova bestia disonorevole e attacca sue mimi! \"Mimi\" significa orecchie! Poi Neko d\u00e0 carro per tuo aiuto! Yakusoku!",
