    "flavor": "Wow! That talent! It's hard to believe you're a Felyne like me! Maybe you could handle an Arzuros, too? Nah... No way just a Felyne could take one of those on... Huh? You'll try it!? My hero!",
    "flavor_de": "Wow! Was f\u00fcr ein Talent... Bist du wirklich eine Felyne wie ich? Kannst du etwa auch einen Arzuros erledi- gen? F\u00fcr eine Felyne ist das doch unm\u00f6glich... Was? Du versuchst's? M-Mein Held!",
