    "flavor_es": "\u00a1Vaya! Cuesta creer que seas un Felyne como yo. Quiz\u00e1 tambi\u00e9n ser\u00edas capaz de v\u00e9rtelas con un Arzuros. No, es imposible que un Felyne ganase a... \u00bf\u00a1Vas a intentarlo!? \u00a1Eres mi h\u00e9roe!",
    "flavor_it": "Miaow, che talento! Da non credere che tu sia Felyne come me! E affronteresti anche un Arzuros? Naaah, un Felyne contro un bestione cos\u00ec non potrebbe mai! Eh? Ci prrroverai?! Grandioso!",
