    "flavor": "Hey, how about a friendly little competition? Let's see if either of us can smash the shell of a Daimyo Hermitaur! I'll even give you a tip: try mounting it first! If you win, I'll give you some more tips!",
    "flavor_de": "Hey, was h\u00e4ltst du von ein- nem kleinen Wettstreit? Ob wohl einer von uns den Pan- zer eines Daimyo Hermitaur brechen kann? Ein Tipp: Spring zuerst auf! Wenn du gewinnst, gibt's mehr Tipps!",
    "flavor_fr": "Un petit concours amical ? Voyons si l'un de nous peut briser la carapace d'un Hermitaur Daimyo ! Un conseil, montez dessus ! Si vous gagnez, je vous donnerai d'autres tuyaux !",
    "flavor_es": "\u00bfOs apetece una competici\u00f3n amistosa? A ver si pod\u00e9is partir el caparaz\u00f3n de un Daimyo Hermitaur. Os dar\u00e9 una pista: intentad montarlo antes. Si gan\u00e1is, os dar\u00e9 m\u00e1s consejos.",
    "flavor_it": "Ehil\u00e0! Ti va una piccola sfida? Vediamo se uno di noi riesce a spaccare la corazza di un Daimyo Hermitaur! Ti concedo anche una dritta: prima saltagli in groppa! Se vinci, avrai altri consigli!",
