    "flavor": "Shimatta... Was delivering new cart when fell victim to cowardly kougeki. \"Kougeki\" means attack! Prowler, get rid of dishonorable beasts and Neko give beloved cart for kind help! Yakusoku!",
    "flavor_de": "Shimatta... Ich liefere neuen Karren aus und dann \u2013 feiger Kougeki. Kougeki hei\u00dft \"Angriff\". Pirscher, werd die ehrlosen Bestien los! Neko bedankt sich mit geliebtem Karren. Yakusoku!",
    "flavor_fr": "Des l\u00e2ches m'ont attaqu\u00e9 alors que je livrais un nouveau chariot ! C'est contraire au Bushido ! Miaroudeur, \u00e9liminez ces b\u00eates sans honneur et je vous donnerai mon chariot !",
    "flavor_es": "Shimatta... Iba a entregar un carro nuevo cuando sufr\u00ed un vil kougeki (que significa ataque). Deshazte de esas bestias sin honor y Neko te dar\u00e1 un carro a cambio de tu ayuda. \u00a1Yakusoku!",
    "flavor_it": "Shimatta... Neko consegnava nuovo carro e a improvviso subisce kougeki vigliacco. \"Kougeki\" significa attacco! Cacciamiao, elimina bestie disonorevoli e Neko d\u00e0 carro per tuo aiuto! Yakusoku!",
