    "flavor": "I found some Felynes strong and wise. I'm sure they'd make for great allies! Go forth to aid them without pause and maybe then they'll join our cause!",
    "flavor_de": "Ich habe im Marschland ein ganz s\u00fc\u00dfes kleines Ding ge- funden. Aber \u00fcberall lauern Monster... Hilfst du mir? Dann k\u00f6nnte ich noch mehr dieser guten Seelen finden!",
    "flavor_fr": "J'ai d\u00e9couvert une adorable petite cr\u00e9ature dans les Marais, mais il y a tant de monstres qui y r\u00f4dent... Si vous m'aidiez, je pourrais d\u00e9nicher d'autres de ces jolies petites b\u00eates !",
    "flavor_es": "He encontrado una monada en la Ci\u00e9naga, pero al parecer est\u00e1 plagada de monstruos. \u00bfMe echas una mano? Si lo logras, puede que encuentre a\u00fan m\u00e1s almas prometedoras.",
