    "flavor": "I wish to hold a ball in the Jurassic Frontier, but some ruffians have crashed the venue, and their clothes are simply atrocious... Ooh, I can't stand it! Would you be a darling and drive them off?",
    "flavor_de": "Ich m\u00f6chte einen Ball im Jura-Grenzland geben, aber einige R\u00fcpel haben den Ort demoliert. Und ihre scheu\u00df- liche Kleidung... einfach unertr\u00e4glich! Bist du so nett und vertreibst sie?",
    "flavor_fr": "Je compte organiser un bal \u00e0 la Fronti\u00e8re jurassique, mais des malotrus ont saccag\u00e9 la salle et leur plumage est tout simplement hideux. C'est inacceptable ! Pourriez-vous les chasser ?",
    "flavor_es": "Quiero celebrar un baile en la Fronda Arcaica, pero unos rufianes se han colado en el recinto. Llevan un atuendo infame. No puedo soportarlo. \u00bfTendr\u00edas la gentileza de echarlos?",
    "flavor_it": "Gradirei dare un ballo nella frontiera giurassica, ma dei bricconi sono giunti senza invito e i loro soprabiti sono proprio vili... Oh, non posso sopportarlo! Sarebbe cos\u00ec gentile da cacciarli?",
