    "flavor": "For today's menu, Mountain Herbal Soup! Highly nourishing and purromotes good blood circulation. Now, it's quite easy to make, but I do need lots of Mountain Herbs. Meow get moving!",
    "flavor_de": "Heute steht Gebirgskr\u00e4uter- suppe auf dem Speiseplan! Sehr nahrhaft und gut f\u00fcr den Kreislauf. Das Rezept ist einfach, aber ich brau- che viele Gebirgskr\u00e4uter. Miau, los geht's!",
    "flavor_fr": "Le plat du jour, c'est soupe d'herbes de montagne ! Elle est nutritive et fouette les sangs. Facile \u00e0 pr\u00e9parer, elle n\u00e9cessite beaucoup d'herbes de montagne. Mettez la patte \u00e0 la p\u00e2te !",
    "flavor_es": "Para hoy tenemos sopa de hierbas de monta\u00f1a. Es muy nutritiva y buena para la circulaci\u00f3n. Es f\u00e1cil de preparar, pero necesito muchas hierbas de monta\u00f1a. \u00a1Miau, ponte en marcha!",
    "flavor_it": "Sul menu di oggi, zuppa alle erbe montane! Favorisce la circolazione del sangue ed \u00e8 miaolto nutriente! Non \u00e8 complicato prrrepararla, ma mi servono parecchie erbe di montagna. Prrrocuramele tu!",
