    "flavor": "Ah, my good Prowler friend! It must be fate that brought us together again! This time, I want you to collect points in the Misty Peaks. Deliver whatever items you like. Oughta be a breeze for you, eh?",
    "flavor_de": "Ah, Pirscher, mein Freund! Das muss Schicksal sein. Diesmal sammle in den Nebelgipfeln Punkte f\u00fcr mich. Liefere als Objekte ab, was du willst. Das ist doch ein Kinderspiel f\u00fcr dich, oder?",
    "flavor_fr": "Ah, mon bon Miaroudeur ! Le destin nous r\u00e9unit encore ! Il faudrait cette fois que vous r\u00e9cup\u00e9riez des points aux Pics brumeux. Livrez ce qui vous chante. \u00c7a n'a rien de compliqu\u00e9, si ?",
    "flavor_es": "\u00a1Mi buen gatador! \u00a1Debe de ser el destino el que nos re\u00fane! Me gustar\u00eda que obtuvieses puntos en las Picos Nublados. Entrega lo que quieras. Te resultar\u00e1 sencillo, ya ver\u00e1s.",
    "flavor_it": "Ah, il destino ci riunisce nuovamente, cacciamiao! Stavolta voglio che tu raccolga punti sulle cime nebbiose. Consegna pure gli oggetti che vuoi. Per te sar\u00e0 una passeggiata, no?",
