    "flavor": "I'm studying the nighttime ecology of the Jurassic Frontier, but some Rhenoplos keep getting in my way. Can you help me? They like to charge foes, so try luring them into walls to stun them!",
    "flavor_de": "Ich studiere die n\u00e4chtliche \u00d6kologie des Jura-Grenzlands, aber einige Rhenoplos sind mir immer im Weg. Hilfst du mir? Sie greifen Feinde gerne an, also versuch, sie im Gem\u00e4uer zu \u00fcberrumpeln!",
    "flavor_fr": "J'\u00e9tudie la vie nocturne de la Fronti\u00e8re jurassique, mais les Rhenoplos m'interrompent sans cesse. Pourriez-vous m'aider ? Ils aiment charger, alors attirez-les vers des murs pour les \u00e9tourdir !",
    "flavor_es": "Estoy estudiando la ecolog\u00eda nocturna de la Fronda Arcaica, pero no paran de molestarme unos Rhenoplos. \u00bfMe ayudas? Como les gusta embestir, si los atraes hacia un muro los aturdir\u00e1s.",
    "flavor_it": "Sto studiando l'ecosistema notturno della frontiera giurassica, ma dei Rhenoplos mi interrompono sempre. Puoi aiutarmi? Spesso caricano i nemici, ma se sbattono alle pareti... puoi stordirli!",
