    "flavor": "Hi there, Prowler! Seen any Silver Crickets around here? No? Aww... I hear there are tons of them on the Deserted Island, but my parents won't let me go on my own... Can you go and get some for me!?",
    "flavor_de": "Hey, du, Pirscher! Hast du hier Silbergrillen gesehen? Nein? Mh... Angeblich gibt's viele auf der \u00d6dnis-Insel, aber da lassen meine Eltern mich nicht hin. Kannst du mir von da welche holen?!",
    "flavor_fr": "Bonjour, Miaroudeur ! Vous n'auriez pas vu des Grillons argent\u00e9s ? Non ? Zut... Il para\u00eet que l'\u00cele d\u00e9serte en regorge, mais mes parents m'interdisent d'y aller. Vous pourriez m'en rapporter ?",
    "flavor_es": "\u00a1Hola! \u00bfHas visto por aqu\u00ed grillos plateados? \u00bfNo? Jo, he o\u00eddo que hay un mont\u00f3n en la Isla Desierta, pero mis padres no me dejan ir solo... \u00bfPuedes traerme unos cuantos?",
    "flavor_it": "Ehi, cacciamiao! Hai visto dei grilli argentei qui in giro? No, vero? Uff... Sull'isola deserta ce ne sono a volont\u00e0, ma i miei non mi mandano da solo! Me ne prenderesti qualcuno tu?",
