    "flavor": "We've secured the venue for our ball, but alas, I have yet to find my partner... Ah, you there! Would you join me for a dance? My, what large feathers yo-- a Great Maccao!? Help!",
    "flavor_de": "Den Ort f\u00fcr unseren Ball haben wir gefunden, aber leider fehlt mir noch ein Partner... Ah, du da! Tanzt du mit mir? Oh, was hast du nur f\u00fcr gro\u00dfe Federn \u2013 ein Gro\u00df-Maccao?! Zu Hilfe!",
    "flavor_fr": "Nous avons enfin trouv\u00e9 une salle de bal, mais je n'ai toujours pas de partenaire. Vous, l\u00e0 ! Voudriez-vous danser avec moi ? Quelles belles plumes vous... Un Grand Maccao ? \u00c0 l'aide !",
    "flavor_es": "Hemos reservado el sitio para el baile, pero a\u00fan no he encontrado pareja... \u00a1Eh, t\u00fa! \u00bfQuieres bailar conmigo? \u00a1Vaya, qu\u00e9 plumas m\u00e1s grandes tie...! \u00a1Un Gran Maccao! \u00a1Socorro!",
