    "flavor_de": "Es hie\u00df, es ginge nur um Ceanatauren, aber hier sind genauso viele Uroktor. Mir ist egal, welche von den beiden, aber kannst du ein paar \u00fcbernehmen? Ich brau- che wirklich deine Hilfe!",
