    "flavor_es": "Acept\u00e9 el encargo de matar algunos Ceanataur, pero al llegar all\u00ed, tambi\u00e9n hab\u00eda un mont\u00f3n de Uroktor. \u00bfMe ayudas a reducir su n\u00famero? Los que prefieras, me da igual. Necesito ayuda.",
    "flavor_it": "Ho accettato di abbattere dei Ceanataur, ma una volta arrivata in zona ho trovato anche parecchi Uroktor! Potresti aiutarmi? Puoi eliminare chi vuoi, devi solo sfoltirne il numero!",
    "flavor_ja": "",
    "sub_reward": "0",
    "sub_hrp": "0"
