    "flavor": "Oh... I'm so hungry I could eat a Plesioth! But I'd be satisfied with some smaller fish... Could you bring me some? Preferably Goldenfish! Their golden scales are so purrty, I bet they taste pawsitively delightful!",
    "flavor_de": "Oh... Ich k\u00f6nnte vor lauter Hunger einen Plesioth verspeisen! Kleinere Fische w\u00e4ren auch schon was. Holst du mir welche? Goldenfische mit ihren goldenen Schuppen schmecken sicher k\u00f6stlich!",
    "flavor_fr": "J'ai faim ! Je pourrais d\u00e9vorer un Plesioth ! Mais des petits poissons d'or, avec leurs jolies \u00e9cailles, feraient aussi l'affaire ! Vous m'en apporteriez ? J'en chalive d'avance !",
    "flavor_es": "\u00a1Tengo tanta hambre que me comer\u00eda un Plesioth! Pero me conformar\u00eda con peces peque\u00f1os. \u00bfPodr\u00edas traeme unos pocos peces dorados? \u00a1Sus escamas son preciosas! Seguro que son deliciosas.",
    "flavor_it": "Oh, che fame! Mi mangerei un Plesioth! In realt\u00e0 anche qualche pesce pi\u00f9 piccolino sarebbe sufficiente. Me ne porteresti qualcuno? Magari dei pesci-dorati! Le scaglie dorate sono prrregiate!",
