    "flavor_es": "Y el aspirante... \u00bf\u00a1Un gatador!? \u00a1Qu\u00e9 mono! \u00a1Qu\u00e9 valor! No te da miedo un Bulldrome, \u00bfeh? \u00bfQu\u00e9 te parece v\u00e9rtelas mano a mano con un Arzuros justo despu\u00e9s? \u00bfNo?",
