    "flavor_de": "Du zielst wirklich recht gut auf K\u00f6rperteile, aber kannst vom \"Teilebrecher\" noch viel lernen. Zertr\u00fcmmere zur \u00dcbung ein paar Kecha- Wacha-Ohren! Tipp: An den Ranken ist er zu weit weg.",
