    "flavor_es": "\u00a1Mi gatador favorito! \u00a1El destino nos vuelve a unir! Te quer\u00eda pedir que obtengas puntos para m\u00ed en el Hoyo Volc\u00e1n. Entrega lo que quieras. Seguro que te resulta sencillo.",
    "flavor_it": "Ah, il destino ci riunisce nuovamente, cacciamiao! Vorrei chiederti di raccogliere punti alla fossa vulcanica. Consegna pure gli oggetti che vuoi. Per te sar\u00e0 una passeggiata, no?",
