    "flavor": "Yikes! What are those things!? Twins? I thought I was seeing double! Even if you can catch them on their own, they'll call the little ones and purrolong the fight. At any rate, don't get in over your whiskers!",
    "flavor_de": "Huch! Was ist das denn?! Zwillinge? Ich dachte erst, ich sehe doppelt! Auf sich allein gestellt rufen sie die Kleinen, der Kampf wird z\u00e4h! Lass dir nicht auf die Schnurrhaare treten!",
    "flavor_fr": "Mais qu'est-ce que c'est que chat ? Des jumeaux ? J'ai cru voir double ! Si on en chasse un, il crie au secours et d'autres arrivent en renfort. Attention \u00e0 ne pas vous faire submerger !",
    "flavor_es": "\u00a1Ostras! \u00bf\u00a1Qu\u00e9 es eso!? \u00bfGemelos? Cre\u00eda que ve\u00eda doble. Aunque los pilles solos, llaman a los peque\u00f1os y alargan el combate. As\u00ed que ten cuidado con d\u00f3nde metes los bigotes.",
    "flavor_it": "Miargh! Cosa sono quelli?! Gemelli? Credevo di vederci doppio! Anche se li prrrendi da soli, richiameranno i piccoli, prrrolungando lo scontro. Vedi di non fare il passo pi\u00f9 lungo della zampa!",
