    "flavor_fr": "Tu t'\u00e9clates ? Vise un peu toutes ces \u00e9cailles ! Ce Malfestio est d'un sans- g\u00eane ! Quelques coups sur le cr\u00e2ne lui remettront les id\u00e9es en place. Utilise ton boomerang si tu es trop loin !",
