    "flavor_it": "Bella, oh! Com'\u00e8, si spacca di brutto? Ma le vedi tutte queste scaglie? Mi sa che va spiegato al Malfestio di non sporcare. Ficcaglielo in testa! E se non riesci ad avvicinarti, usa il 'rang!",
