    "flavor_de": "Ich habe am Frostseeweg ein paar Blumen gesucht, aber dann hat ein riesiger Hase Schneeb\u00e4lle nach mir gewor- fen! F\u00fcr solche Grobheiten sind die Bl\u00fcmchen viel zu zart \u2013 Schluss damit!",
