    "flavor": "Hey, just the Prowler I need! That egg you got me did the trick! My adorable lil' sis... she's all better! Now that she's Felyne fine, I wanna give her rare stones as a purresent. Only the best for my sis!",
    "flavor_de": "Hey, Pirscher, warte mal! Das Ei von dir war Gold wert. Meiner lieben kleinen Schwester geht's wieder gut. Ich will ihr jetzt seltene Steine schenken. F\u00fcr sie nur das Beste!",
    "flavor_fr": "Ah, voil\u00e0 le Miaroudeur qu'il me faut ! Votre \u0153uf a remis ma petite s\u0153ur sur pieds ! Et je voudrais lui offrir des pierres rares \u00e0 pr\u00e9sent qu'elle va mieux. Elle le m\u00e9rite bien !",
