    "flavor": "Hey, Prowler! I've got the perfect job for you. All you've got to do is play with this ball. It's not yarn, but I promise you it's just as fun! I've made all the preparations. Now, go enjoy yourself!",
    "flavor_de": "Hey, Pirscher! Ich hab genau das Richtige f\u00fcr dich. Du musst nur mit diesem Ball spielen. Der macht so viel Spa\u00df wie ein Wollkn\u00e4uel. Ich hab schon alles vor- bereitet. Viel Spa\u00df damit!",
