    "flavor_es": "\u00a1Eh, gatador! Tengo un trabajo ideal para ti. Solo tienes que jugar con esta bola. Sin lucha, pero te aseguro que es divertido. Lo tengo todo listo. \u00a1Que te diviertas!",
