    "flavor": "Hey, brah! Smashin' tons of parts lately? You must be itchin' for a real challenge, so try rockin' a rock-solid Uragaan head! Tough even for pro bros like me, but try bustin' out some bombs!",
    "flavor_de": "Hey, Kumpel! Viele Teile gebrochen in letzter Zeit? Ein steinharter Uragaan- Kopf ist eine Herausfor- derung \u2013 selbst f\u00fcr einen Profi wie mich schwierig! Bomben hochjagen erlaubt!",
