    "flavor": "And now for the weather in the Frozen Seaway. The fair skies take a turn for the worse as Remobras cloud the skies and bring a chance of poison showers. Don't forget your umbrella!",
    "flavor_de": "Und jetzt zum Wetter am Frostseeweg. Es zieht sich zu und wird d\u00fcster, da Remobras den Himmel verdunkeln. Dabei k\u00f6nnen Giftschauer auftreten. Vergiss deinen Schirm nicht!",
