    "flavor": "Now that you understand the basics, Prowler, it's time to prowl! For starters, take down a Larinoth, carve some Raw Meat from it, then deliver it to base camp! It might sound easy, but don't get careless!",
    "flavor_de": "Da du nun die Grundlagen ver- standen hast, kannst du nun jagen gehen. Kannst du einen Larinoth erlegen, Rohes Fleisch von ihm erbeuten und es ins Basislager bringen? Klingt einfach, ist es aber nicht!",
    "flavor_fr": "Les bases sont acquises, il est temps de partir en miaroude ! D'abord, tuez un Larinoth et d\u00e9coupez-en un morceau de viande crue pour le camp de base. Attention quand m\u00eame !",
    "flavor_es": "Ahora que entiendes las nociones b\u00e1sicas, gatador, es hora de gatar. Empieza por un Larinoth, corta carne cruda y entr\u00e9gala en el campamento base. \u00a1Suena f\u00e1cil, pero ten cuidado!",
