    "flavor_fr": "Miaroudeur ! Rendez donc service \u00e0 votre instructeur pr\u00e9f\u00e9r\u00e9. Rassemblez des composants pour fabriquer un d\u00e9odorant ! \u00c7a vous fera une bonne le\u00e7on. Et je ne me prendrai pas un r\u00e2teau !",
