    "flavor": "Okay, Prowler! The next step of your training is to fish up and deliver a Glutton Tuna! But don't you worry your whiskers -- the Master of Style will be there to teach you everything you need to know about fishing!",
    "flavor_de": "Okay, Pirscher! Der n\u00e4chste Schritt deines Trainings ist das Angeln und Abliefern eines Schlemmthunfischs! Der Jagdstil-Meister wird bei dir sein und dir alles N\u00f6tige \u00fcber das Angeln beibringen!",
    "flavor_fr": "OK, Miaroudeur ! Prochaine \u00e9tape : p\u00eacher un thon glouton et le ramener ! Mais ne vous en faites pas, je suis l\u00e0 pour vous apprendre tout ce que vous avez besoin de savoir.",
