    "flavor_de": "Hey, Pirscher! Wei\u00dft du, wie man Fleischfresser-Eier transpor- tiert, ohne sie zu zerbrechen? Gleich wirst du es wissen! Denk daran, sie sind empfindlich! Mach also alle Maccaos unsch\u00e4dlich, ehe du dir die Eier schnappst!",
