    "flavor_de": "Na, wer ist denn da? Diesmal konzentrieren wir uns darauf, wie man als Pirscher ein Monster f\u00e4ngt. Das ist anders als bei J\u00e4gern, also pass auf! Wir behandeln auch ein paar n\u00fctz- liche Unterst\u00fctzungsaktionen!",
