    "flavor": "Hehehe! This is quite the haul! A group of Uragaan've shown up near the Volcano! We can pick 'em off at our leisure! Although, there're a few too many for me to face alone. Think ya can give me a hand?",
    "flavor_de": "Hehehe! Ein h\u00fcbscher Fang! Am Vulkan wurde eine Gruppe Uragaan gesichtet. Leichte Beute durch und durch! Aber f\u00fcr mich allein ein paar zu viele, packst du mit an?",
    "flavor_fr": "H\u00e9 h\u00e9 ! Cette fois, c'est le gros lot ! Un groupe d'Uragaan est apparu pr\u00e8s du Volcan ! Bref, y'a plus qu'\u00e0, mais ils sont trop nombreux pour moi. Vous me donnez un coup de main ?",
    "flavor_es": "\u00a1Ja, ja! \u00a1Menudo bot\u00edn! Un grupo de Uragaan ha aparecido en el Volc\u00e1n. \u00a1Los tenemos en nuestras manos! Aunque quiz\u00e1 sean muchos para ir solo. \u00bfMe echas una mano?",
    "flavor_it": "Eh eh eh! Che occasione! Vicino al vulcano \u00e8 comparso un branco di Uragaan! Io dico di fare man bassa! D'altra parte, non posso sconfiggerli tutti da solo. Perch\u00e9 non mi dai una mano tu?",
