    "flavor": "There's some weirdos makin' trouble in this area. I don't care why they're here, they just need to get gone! Think you can do somethin' 'bout it? If you do, I might give you somethin' good.",
    "flavor_de": "Ein paar schr\u00e4ge V\u00f6gel machen die Gegend unsicher. Mir ganz egal, was die hier machen, aber sie m\u00fcssen verschwinden! Meinst du, du kannst da was tun? Wenn ja, kriegst du was Gutes von mir.",
    "flavor_fr": "Des types bizarres font des leurs dans la r\u00e9gion. Je ne veux pas savoir pourquoi, ils doivent s'en aller, point final ! Vous pourriez intervenir ? Je saurai me montrer g\u00e9n\u00e9reux !",
    "flavor_es": "Unos tipos raros est\u00e1n causando problemas. No s\u00e9 qu\u00e9 hacen aqu\u00ed, pero quiero que se vayan. \u00bfCrees que puedes encargarte de ello? Si lo consigues, puede que tenga algo a cambio...",
