    "flavor": "In the red corner, we have the Immovable Mountain: the one and only Gammoth! And from the blue corner we have the brave hunter who refuses to lose! Our winner will receive a fabulous prize, so good luck!",
    "flavor_de": "In der roten Ecke haben wir den unersch\u00fctterlichen Berg: den einzigartigen Gammoth! Und in der blauen Ecke: der tapfere J\u00e4ger, der keine Niederlage akzeptiert. Den Sieger erwartet ein toller Preis. Viel Gl\u00fcck!",
    "flavor_fr": "Dans le coin rouge, nous avons l'Immuable montagne, j'ai nomm\u00e9 le seul, l'unique... Gammoth ! En face de lui, un chasseur d\u00e9termin\u00e9 \u00e0 triompher ! Que le meilleur gagne !",
    "flavor_es": "En la esquina roja, tenemos a la monta\u00f1a inamovible: \u00a1el Gammoth! Y en la esquina azul, \u00a1tenemos al valiente cazador que se niega a perder! El ganador recibir\u00e1 un premio fabuloso. \u00a1Suerte!",
    "flavor_it": "Nell'angolo rosso, la montagna vivente: l'unico e solo Gammoth! Nell'angolo blu, l'ardita stella della caccia! Al vincitore spetta un premio favoloso, quindi... Buona fortuna a entrambi!",
