    "flavor": "It's so fascinating to see these monsters rolling about. And just as I was thinking how grand it would be to see three of them at once, here they are! If you're able to hunt these monsters, I'll give you a special present.",
    "flavor_de": "Es ist faszinierend, diese Monster herumrollen zu sehen. Und gerade als ich dachte, ich w\u00fcrde gerne drei gleichzeitig sehen, sind sie auch schon da! Wenn du sie jagst, gebe ich dir ein besonderes Geschenk.",
    "flavor_fr": "Fascinant spectacle que celui de ces monstres qui tournent et roulent sans jamais s'arr\u00eater ! Puisque vous \u00eates l\u00e0, chassez-en 3 et je vous remettrai un cadeau tr\u00e8s sp\u00e9cial.",
    "flavor_es": "Es fascinante ver a estos monstruos rodando. Y justo cuando pensaba lo chulo que ser\u00eda ver a tres de ellos juntos, \u00a1aqu\u00ed est\u00e1n! Si los cazas, te har\u00e9 un regalo especial.",
