    "flavor": "I'm smelling the worst smell from somewhere... It doesn't seem to be coming from a monster, but it stinks nonetheless. Think you could go deal with it for me? Oh, and if you could remove this spear for me, that'd be great.",
    "flavor_de": "Ich hab einen ganz \u00fcblen Geruch in der Nase. Es scheint kein Monster zu sein, aber es stinkt. K\u00f6nntest du dich vielleicht darum k\u00fcmmern? Oh, und es w\u00e4re toll, wenn du diesen Speer f\u00fcr mich entfernen w\u00fcrdest.",
    "flavor_fr": "Quelle odeur \u00e9c\u0153urante ! Je doute qu'elle provienne d'un monstre, mais quand m\u00eame... \u00e7a fouette ! Faites quelque chose ! Et pendant que vous y \u00eates, si vous pouviez \u00f4ter cette lance...",
