    "flavor_es": "\u00a1Aqu\u00ed Star Fox! He visto un H\u00edper monstruo cerca de las Cimas \u00c1rticas. Sin embargo, la inestabilidad me impide aterrizar. Neutral\u00edzalo y te recompensar\u00e9 bien. \u00a1Buena suerte!",
    "flavor_it": "Qui Star Fox! Ho individuato un mostro iper vicino al monte artico, ma il settore \u00e8 instabile! Io non posso atterrare, quindi dovrai pensarci tu. Ti ricompenser\u00f2 a dovere! E buona fortuna!",
    "flavor_ja": "",
