    "flavor": "Something is plotting to steal the galaxy's most powerful weapon! Scanning... That beak, that ominous purple skin... Could it be!? Please, Hunter! Hurry to the Volcanic Hollow before it's too late!",
    "flavor_de": "Irgendjemand plant, die m\u00e4chtigste Waffe der Welt zu stehlen! Scanne... Dieser Schnabel, die unheilvolle lila Haut... Kann das wahr sein? Bitte, J\u00e4ger! Eile zur Vulkan- mulde, bevor es zu sp\u00e4t ist!",
    "flavor_fr": "Une cr\u00e9ature s'appr\u00eate \u00e0 voler l'arme la plus puissante de la galaxie ! Analyse en cours... Un bec, une peau violac\u00e9e... Bon sang ! Du nerf, Chasseur, au Vallon volcanique !",
    "flavor_es": "Algo est\u00e1 tramando robar el arma m\u00e1s potente de la galaxia. Ese pico y esa piel p\u00farpura. \u00bfEs posible? \u00a1Por favor, cazador! Ve al Hoyo Volc\u00e1n antes de que sea demasiado tarde.",
    "flavor_it": "Una creatura sta tentando di rubare l'arma pi\u00f9 potente della galassia! Scansione... Quel becco, quella sinistra pelle viola... Possibile?! Corri alla fossa vulcanica, prima che sia troppo tardi!",
