    "flavor": "Hey, can you hear that? One of the monsters fled that way. Well, I guess it's not really much of a monster, more of a bug, actually. Anyways, if you can take care of it for me, I'll be sure to make it worth your while.",
    "flavor_de": "Hey, kannst du das h\u00f6ren? Ein Monster ist in diese Richtung geflohen. Also, kein richtiges Monster, mehr eine Art K\u00e4fer. Wie auch immer, wenn du das Ding f\u00fcr mich erledigst, soll es sich f\u00fcr dich lohnen.",
    "flavor_fr": "H\u00e9, vous entendez ? L'un des monstres a fil\u00e9 par l\u00e0. Il ressemble plut\u00f4t \u00e0 un insecte, d'ailleurs. Enfin bref, occupez-vous de son cas et vous n'aurez pas \u00e0 le regretter.",
    "flavor_es": "Eh, \u00bfoyes eso? Uno de los monstruos ha escapado. Supongo que no es realmente un monstruo, sino m\u00e1s bien un bicho. Bueno, si te ocupas de \u00e9l, te compensar\u00e9 como es debido.",
    "flavor_it": "Ehi, lo senti? Un mostro \u00e8 fuggito da quella parte. Beh, non \u00e8 proprio un mostro. Sembra pi\u00f9 un insetto, in realt\u00e0. Comunque... Se lo togli di mezzo, sono pronto a offrirti un degno compenso.",
