    "flavor": "The Royal Ludroth is a royal pain. Every time a hunter gets rid of one, it seems another pops up in its place. Reminds me of a certain evil scientist. No matter how many times he's defeated, he keeps coming back!",
    "flavor_de": "Der K\u00f6nigs-Ludroth geht mir k\u00f6niglich auf die Nerven. Kaum hat ein J\u00e4ger einen erlegt, taucht schon der n\u00e4chste auf. Erinnert mich an einen gewissen b\u00f6sen Wissenschaftler. Der kommt auch immer wieder!",
    "flavor_fr": "Le Ludroth royal est une vraie plaie ! On a beau les \u00e9liminer, on n'en voit jamais le bout. \u00c7a me rappelle ce savant fou... Lui aussi, il ne cesse de revenir quoi qu'on fasse !",
    "flavor_es": "El Ludroth Real es realmente molesto. Cada vez que un cazador se carga uno, otro aparece en su lugar. Es como un cient\u00edfico malvado que conozco. Aunque le derrotes, \u00a1siempre acaba volviendo!",
    "flavor_it": "I Ludroth reali sono una tortura. Quando un cacciatore ne elimina uno, subito ne compare un altro. Uhm, mi ricordano un certo scienziato pazzo... Sempre sconfitto e sempre pronto a tornare!",
