    "flavor": "I have THE WORST writer's block right now. I want to compose a song that depicts the emotion of a hunt, but I have zero inspi- ration. I bet if I saw you in action, the notes would come pouring out of my pen.",
    "flavor_de": "Ich habe die SCHLIMMSTE Komponierblockade aller Zeiten. Ich will die Emotionen der Jagd in einem Lied festhalten, aber mir fehlt die Inspiration. Wenn ich dich in Aktion s\u00e4he, w\u00fcrden die Noten sicher nur so purzeln.",
    "flavor_fr": "Je souhaite composer une m\u00e9lodie \u00e9voquant ce que l'on ressent \u00e0 la chasse, mais je suis en panne d'inspiration. Vous voir \u00e0 l'\u0153uvre stimulerait sans doute ma cr\u00e9ativit\u00e9.",
    "flavor_es": "Tengo un bloqueo mental muy grande. Quiero componer una canci\u00f3n que describa la emoci\u00f3n de una caza, pero no estoy inspirado. Si te viera en acci\u00f3n, las notas brotar\u00edan de mi pluma.",
    "flavor_it": "Sono in crisi nera. Vorrei comporre una melodia che rievochi le emozioni della caccia, ma non sono ispirato. Se ti vedessi in azione, per\u00f2, le note tornerebbero a sgorgare dalla mia penna.",
