    "flavor": "Nya, nya, nya, nya, nya! I'm here to give you a super cool deluxe purresent! Although, nothing comes for furree! You need to win the little hunting tournament we're purrlanning! Now, let's get started, nya!",
    "flavor_de": "Miau! Miaumiaumiau! Ich bin hier, um dir ein ganz fant-tatz- tisches Geschenk zu machen! Obwohl \u2013 alles hat seinen Preis! Du musst schnurrerst das kleine Jagdturnier gewinnen, das wir planen. Na, dann los, miau!",
    "flavor_fr": "Miaou, miaou, miaou ! On m'envoie vous remettre un superbe chadeau ! Cela dit, rien n'est gratuit. Il vous faudra d'abord gagner notre tournoi de chasse. C'est parti, miaou !",
    "flavor_es": "\u00a1Miau, miau, miau! He venido a darte un regalo de lujo superchulo. Pero todo tiene un precio: debes ganar el torneo de caza que hemos preparado. \u00a1Venga, a por ello!",
