    "flavor": "Is there anybody willing to face the majestic Kirin that has just manifested in the Forlorn Arena? Nothing has prepared you for the likes of this beast. If you wish to experience a land filled with dreams, please step forth.",
    "flavor_de": "Wer ist bereit, dem majest\u00e4- tischen Kirin entgegenzutreten, der beim Verbotenen Turm sein Unwesen treibt? Dieses Gesch\u00f6pf entzieht sich jeder Erfahrung. Wer ein Land voller Tr\u00e4ume erleben will, trete vor.",
    "flavor_fr": "Qui osera se mesurer au majestueux Kirin qui vient d'appara\u00eetre \u00e0 la Tour interdite ? Si vous voulez braver les dangers d'un monde onirique, faites un pas en avant.",
    "flavor_es": "\u00bfAlguien quiere enfrentarse al majestuoso Kirin que merodea por Forlorn? Nada te ha preparado para algo as\u00ed, de modo que si quieres sentir una tierra llena de sue\u00f1os, da un paso adelante.",
    "flavor_it": "Qualcuno ha il coraggio di affrontare il maestoso Kirin comparso nell'arena desolata? \u00c8 una bestia diversa da qualsiasi altra. Se volete immergervi in una terra di sogni, fatevi avanti.",
