    "flavor_fr": "De nombreux observateurs ont rep\u00e9r\u00e9 les traces d'un Chameleos pr\u00e8s de la Tour interdite et la Guilde a eu vent d'attaques toxiques non identifi\u00e9es. \u00c0 vous de mener l'enqu\u00eate, Chasseur.",
