    "flavor": "Lately, in the deepest reaches of the polar region, the earth has been shaking tremendously. The people fear the very ground will open up and swallow them whole. Their fears may become reality if something is not done.",
    "flavor_de": "In j\u00fcngster Zeit erbebte in den Tiefen der Polarregion die Erde aufs Heftigste. Die Leute dort f\u00fcrchten, der Boden werde sich auftun und sie verschlingen. Wenn nichts unternommen wird, k\u00f6nnte sich das bewahrheiten.",
    "flavor_fr": "Derni\u00e8rement, la terre s'est mise \u00e0 trembler dans les confins polaires et les gens craignent d'\u00eatre engloutis dans les ab\u00eemes. Si on ne r\u00e9agit pas, cela risque fort de finir ainsi.",
    "flavor_es": "En los rincones m\u00e1s ocultos de la regi\u00f3n polar, la tierra se agita con fuerza. La gente teme que el suelo se abra y les engulla. Sus miedos pueden materializarse si nadie hace nada.",
    "flavor_it": "Nei recessi della regione polare, una tremenda scossa ha investito la terra. Temono tutti che si spalancher\u00e0 una voragine. Se non facciamo qualcosa, le loro paure potrebbero diventare realt\u00e0.",
