    "flavor": "From the heavens descended a being bathed in light from a sacred mountain. With it, came a storm that plunged the world into calamity. Someone, deliver us from this evil, lest we exist in darkness forever.",
    "flavor_de": "Ein Wesen stieg vom Himmel herab, das in das Licht eines heiligen Berges geh\u00fcllt war. Mit ihm kam ein Sturm, der die Welt ins Verderben st\u00fcrzte. Jemand befreie uns von diesem \u00dcbel und der ewigen Finsternis.",
    "flavor_fr": "Des cieux descendit un \u00eatre ceint d'un halo lumineux en provenance d'une montagne sacr\u00e9e, amenant avec lui une temp\u00eate qui plongea le monde dans le chaos. Piti\u00e9, d\u00e9livrez-nous du mal.",
    "flavor_es": "De los cielos baj\u00f3 un ser iluminado por una monta\u00f1a sagrada. Y consigo trajo una tormenta que sumi\u00f3 el mundo en el caos. Alguien debe librarnos de este mal o viviremos en la oscuridad.",
    "flavor_it": "Dai cieli \u00e8 disceso un essere intriso della luce di una montagna sacra. Con esso sono giunte tempeste e rovina. Qualcuno ci liberi da questo male, o vivremo per sempre immersi nell'oscurit\u00e0.",
