    "flavor": "Long time, no see, hunters. I've prepared a test for you all. This day your opponent is an Alatreon. Which will emerge victorious in battle, you? Or the beast feared by the very heavens themselves!?",
    "flavor_de": "Lange nicht gesehen, liebe J\u00e4ger. Ich habe eine Pr\u00fcfung f\u00fcr euch vorbereitet. Euer heu- tiger Gegner ist ein Alatreon. Wer wird am Ende siegreich sein? Ihr oder die Bestie, die selbst der Himmel f\u00fcrchtet?",
    "flavor_fr": "Cela faisait longtemps, Chasseurs. Je vous ai pr\u00e9par\u00e9 un test au cours duquel vous devrez affronter un Alatreon. Parviendrez-vous \u00e0 dompter le fl\u00e9au des cieux ?",
    "flavor_es": "\u00a1Cu\u00e1nto tiempo, cazadores! Os he preparado una prueba. Vuestro rival hoy ser\u00e1 un Alatreon. \u00bfQui\u00e9n saldr\u00e1 victorioso en la batalla? \u00bfVosotros o esta bestia temida hasta en el cielo?",
    "flavor_it": "Ne \u00e8 passato di tempo, cacciatori. Ho deciso di sottoporvi una prova. Oggi affronterete un Alatreon. Chi avr\u00e0 la meglio? Voi? O l'orribile bestia temuta persino dagli dei?",
