    "flavor": "I've received an urgent request from the Wycademy. It seems that another Nakarkos has been spotted in Wyvern's End. I'd like to avoid a situation like before. Hunter you must face and defeat that Nakarkos!",
    "flavor_de": "Ich habe eine dringende Anfrage der Wykademie erhalten. Offen- bar wurde in Wyvernsend ein weiterer Nakarkos gesichtet. Ich will nicht noch mal so eine Situation wie k\u00fcrzlich. Du musst den Nakarkos ausschalten!",
    "flavor_fr": "J'ai re\u00e7u une demande urgente de la Wycad\u00e9mie. Un autre Nakarkos a \u00e9t\u00e9 aper\u00e7u au Cimeti\u00e8re des wyvernes. \u00c9touffez le probl\u00e8me dans l'\u0153uf en terrassant cette cr\u00e9ature !",
    "flavor_es": "Tengo una petici\u00f3n urgente de la Wycademia. Al parecer se ha visto otro Nakarkos en la Fosa Wyvern. Quiero evitar una situaci\u00f3n como la anterior, as\u00ed que debes acabar con ese Nakarkos.",
