    "flavor": "And so it begins! Having honed their fangs over the years, five masters of disaster have just appeared near the Forlorn Arena. Will they prove to be the end of you, or will you overcome them and be the ultimate hunter!?",
    "flavor_de": "Und so beginnt es. Nach Jahren, in denen sie ihre Rei\u00dfz\u00e4hne sch\u00e4rften, sind f\u00fcnf Meister der Verw\u00fcstung beim Verbotenen Turm erschienen. Sind sie dein Ende oder bezwingst du sie und wirst zum ultimativen J\u00e4ger?",
    "flavor_fr": "Alors voil\u00e0... Apr\u00e8s avoir aff\u00fbt\u00e9 leurs crocs pendant des ann\u00e9es, 5 ma\u00eetres du chaos ont d\u00e9barqu\u00e9 \u00e0 la Tour interdite. R\u00e9ussirez- vous \u00e0 les vaincre ou auront-ils raison de vous ?",
    "flavor_es": "\u00a1Lleg\u00f3 el d\u00eda! Tras afilar los colmillos durante a\u00f1os, 5 maestros del desastre han aparecido cerca de Forlorn. \u00bfSer\u00e1 este tu final o te coronar\u00e1s como el cazador definitivo?",
    "flavor_it": "L'ora \u00e8 giunta! Dopo aver affilato le zanne per anni, cinque sovrani della distruzione sono comparsi nei pressi dell'arena desolata. Sar\u00e0 la tua fine, o riuscirai a diventare una leggenda?",
