    "flavor": "My home's constantly in danger, meaning lot's of kids grow up to be hunters. Unfortunately, there aren't any master hunters around to train the newcomers how to hunt Hyper Monsters. Care to show them the ropes?",
    "flavor_de": "Meine Heimat ist st\u00e4ndig in Gefahr. Deswegen werden viele der Kinder J\u00e4ger. Leider gibt es bei uns keine Meisterj\u00e4ger, die den Neulingen zeigen k\u00f6nnen, wie man Ferus-Monster jagt. W\u00fcrdest du vielleicht?",
    "flavor_fr": "Le danger est omnipr\u00e9sent dans la r\u00e9gion et seuls les ma\u00eetres chasseurs savent s'y prendre avec les hyper monstres. Enseignez les ficelles du m\u00e9tier \u00e0 nos apprentis chasseurs !",
    "flavor_es": "Mi aldea est\u00e1 siempre en peligro, as\u00ed que muchos ni\u00f1os se hacen cazadores. Eso s\u00ed, faltan maestros que ense\u00f1en a cazar H\u00edper monstruos. \u00bfTe importar\u00eda ense\u00f1arles lo b\u00e1sico?",
    "flavor_it": "La mia patria \u00e8 costantemente in pericolo e molti ragazzi scelgono di diventare cacciatori, ma abbiamo pochi maestri in grado di istruire le reclute sui mostri iper. Puoi darci una dimostrazione?",
