    "flavor": "As a hunter, you gotta know your limit. For me, ol' Deviljho is mine. That crazy pickle just about did me in on more than one occasion. I heard some nutty hunter is gonna take on two of 'em today.",
    "flavor_de": "Ein J\u00e4ger muss seine Grenzen kennen. Bei mir ist beim D\u00e4monjho Schluss. So einer h\u00e4tte mich schon ein paar mal beinahe erledigt. Angeblich will es irgendein irrer J\u00e4ger heute mit zwei davon aufnehmen.",
    "flavor_fr": "Tout chasseur doit avoir conscience de ses limites. La mienne, c'est le Deviljho. Il a bien failli m'avoir plus d'une fois. On raconte qu'un forcen\u00e9 va en affronter deux \u00e0 la fois.",
    "flavor_es": "Como cazador, debes conocer tu l\u00edmite. El m\u00edo es el Deviljho. Ese bicho loco casi acaba conmigo en m\u00e1s de una ocasi\u00f3n. Al parecer, un chiflado va a intentar cargarse a dos hoy.",
