    "flavor": "Recently, I've been wondering about something... You hunters always carry out my requests without hesitation, but I am curious as to the extent of your strength. I've prepared a little test to see what you can do!",
    "flavor_de": "Ich hab vor Kurzem \u00fcber etwas nachgedacht... Ihr J\u00e4ger f\u00fchrt meine Auftr\u00e4ge ja immer ohne Z\u00f6gern aus, aber ich w\u00fcsste zu gern, wie stark ihr wirklich seid. Deshalb habe ich einen kleinen Test vorbereitet!",
    "flavor_fr": "Quelque chose me turlupine. Vous, les chasseurs, menez toujours vos qu\u00eates \u00e0 bien, mais je m'interroge sur les limites de vos capacit\u00e9s. J'ai donc pr\u00e9par\u00e9 un test pour \u00e9prouver vos talents !",
    "flavor_es": "Hace poco se me ocurri\u00f3 algo: los cazadores siempre acept\u00e1is mis peticiones sin dudar, pero me gustar\u00eda saber la magnitud de vuestra fuerza. He hecho una prueba para ver qu\u00e9 sabes hacer.",
    "flavor_it": "Stavo pensando... Voi cacciatori mi obbedite sempre senza esitazione, ma io voglio capire fin dove si spinge la vostra forza. Ho preparato un test per vedere cosa sai fare!",
