    "flavor_de": "Du da! Du wei\u00dft ja, was man \u00fcber M\u00fc\u00dfiggang sagt... Also sitz hier nicht rum, sondern geh zum Vulkan und sammle ein paar Konto-Objekte f\u00fcr uns. Ganz egal, was. Hauptsache, du packst sie in die Lieferkiste!",
