    "flavor": "Gammoths are so cute and cuddly! Least I thought so 'til I tried to hug one. It attacked me and now I can't even move my arms. I just wanted some wooley lovin'! Why's it gotta be so cold?",
    "flavor_de": "Gammoths sind so s\u00fc\u00df und knuddelig! Dachte ich jeden- falls, bis ich einen umarmen wollte. Er griff an, und jetzt kann ich noch nicht mal mehr die Arme bewegen! Und dabei wollte ich doch nur kuscheln!",
    "flavor_fr": "Le Gammoth est trop chou ! Enfin, c'est ce que je croyais jusqu'\u00e0 ce qu'il m'attaque alors que je voulais juste lui faire un gros c\u00e2lin pour me r\u00e9chauffer !",
    "flavor_es": "Los Gammoth son preciosos. O eso pensaba yo hasta que intent\u00e9 abrazar uno. Me atac\u00f3 y ya no puedo mover los brazos. \u00a1Yo solo quer\u00eda un poco de amor esponjoso! \u00bfPor qu\u00e9 hace tanto fr\u00edo?",
