    "flavor": "Hunter, I don't think I've ever seen anybody hunt with as much style and grace as you! I am hoping that you will put your superior skills on display in the Arena! It truly is an honor to meet you!",
    "flavor_de": "Oh, J\u00e4ger, niemals sah ich jemanden so stilvoll und anmutig jagen wie dich! Ich hoffe, du wirst deine F\u00e4hig- keiten in der Arena unter Beweis stellen. Es ist eine Ehre, dich kennenzulernen!",
    "flavor_fr": "Chasseur, je n'ai jamais vu personne chasser avec autant d'\u00e9l\u00e9gance ! Je compte sur vous pour assurer le spectacle dans l'Ar\u00e8ne. C'est un honneur de vous rencontrer !",
    "flavor_es": "Cazador, creo que nunca he visto a nadie cazar con tanto estilo como t\u00fa. Espero que quieras mostrar tus habilidades superiores en la arena. \u00a1Ha sido un honor conocerte!",
    "flavor_it": "Oh, prodigio della caccia, non ho mai visto nessuno combattere con tale grazia! Spero che metterai le tue formidabili capacit\u00e0 al servizio dell'Arena! \u00c8 un vero onore parlare con te!",
