    "flavor": "Oh my gorsh! I'm finally a MH Fan Club member! I'm schuper pumped! I can't believe I get to fight four Fanged Beasts right off the bat! If we beat 'em we'll be able to make some schuper cute Palico gear!",
    "flavor_de": "Endlisch bin isch Mitglied im MH-Fanclub! Isch bin ja scho aufgerescht! Und isch darf gleisch mit vier Reischschahn- Beschtien k\u00e4mpfen! Wenn dasch klappt, k\u00f6nnen wir schuper Kameradenschachen machen!",
