    "flavor": "Argh! Every time I fight a Rathian, I can't cut off her tail! She's always doing that flippy thing and then I get poisoned. Can you help a girl out and show me how it's done?",
    "flavor_de": "Oh Mann! Wenn ich mit einer Rathian k\u00e4mpfe, schaffe ich es nie, den Schwanz abzutrennen! Die drehen sich immer so rum, und dann werd ich vergiftet. Kannst du mir zeigen, wie das geht?",
