    "flavor": "Yo, what up, brah! Still bringin' the pain to the monster game? You know I have, but my lil' breaker-in-trainin' can't seem to get the hang of cuttin' off tails. Drops some science on her, wouldja?",
    "flavor_de": "Hey, was l\u00e4uft, Kumpel? Immer noch hinter Monstern her? Ich nat\u00fcrlich auch, aber meine kleine Brecher-Auszubildende schafft es einfach nicht, Schw\u00e4nze abzutrennen. Bring ihr das mal bei, ja?",
